[4413] = {name = "[q2]Bauplan: Diskombobulatorstrahl", additional_info = "Benötigt Ingenieurskunst (160)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Diskombobulatorstrahls.\nDiskombobulatorstrahl\n[q2]Benutzen: Verwandelt das Ziel in einen Lepragnom und verringert 12 sec lang seinen Nahkampf- und Zauberschaden um 40, sowie sein Bewegungstempo um 20%. (1 Min Abklingzeit)\n5 AufladungenBenötigt Surrendes bronzenes Dingsda (3), Seidenstoff (2), Jade , Bronzeröhre"},
[4414] = {name = "[q2]Bauplan: Tragbarer bronzener Mörser", additional_info = "Benötigt Ingenieurskunst (165)\n[q2]Benutzen: Lehrt Euch die Herstellung eines tragbaren bronzenen Mörsers.\nTragbarer bronzener Mörser\nBenötigt Ingenieurskunst (165)\n[q2]Benutzen: Fügt 85 to 115 Feuerschaden zu und betäubt Ziele 2 sec lang in einem Umkreis von 5 Metern. Jeglicher Schaden wird den Effekt abbrechen. (1 Min Abklingzeit)\n8 AufladungenBenötigt Bronzeröhre (4), Eisenstrebe , Schweres Sprengpulver (4), Mittleres Leder (4)"},
[4415] = {name = "[q3]Bauplan: Handwerkermonokel", additional_info = "Benötigt Ingenieurskunst (185)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Handwerkermonokels.\n[q2]Handwerkermonokel\nWird beim Anlegen gebunden\nKopf Stoff\n40 Rüstung\n+15 Intelligenz\nHaltbarkeit 45 / 45\nBenötigt Stufe 32\nBenötigt Ingenieurskunst (185)Benötigt Schweres Leder (6), Citrin (2)"},
[4416] = {name = "[q2]Bauplan: Goblin-Landmine", additional_info = "Benötigt Ingenieurskunst (195)\n[q2]Benutzen: Lehrt Euch die Herstellung einer Goblin-Landmine.\nGoblin-Landmine\nBenötigt Ingenieurskunst (195)\n[q2]Benutzen: Platziert die Goblin-Landmine auf dem Boden. Sie explodiert, sobald eine feindliche Kreatur an ihr vorbeigeht, und fügt ihr 394 to 506 Feuerschaden zu. Die Mine ist 1 min lang aktiv. (1 Min Abklingzeit)\nBenötigt Schweres Sprengpulver (3), Eisenbarren (2), Gyrochronatom"},
