[9372] = {name = "[q4]Sul'thraze der Peitscher", additional_info = "Wird beim Aufheben gebunden\nEinzigartigZweihändig Schwert\n108 - 163 Schaden Tempo 2.60\n(52.12 Schaden pro Sekunde)\nHaltbarkeit 120 / 120\nBenötigt Stufe 50\n[q2]Trefferchance: Schlägt einen Feind mit der Wut von Sul'thraze. Verringert die Stärke des Ziels um 15 und fügt 90 to 210 Punkt(e) Schattenschaden sowie 125 Punkt(e) zusätzlichen Schaden im Verlauf von 15 sec zu."},
