[13517] = {name = "Rezept: Alchimistenstein", additional_info = "Wird beim Aufheben gebunden\nBenötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Alchimistensteins.\n\n[q4]Alchimistenstein\nWird beim Aufheben gebunden\nEinzigartigSchmuck\n+8 Willenskraft\nBenötigt Alchimie (300)\n[q2]Anlegen: Erhöht die Effekte, die Heil- und Manatränke auf den Träger haben, um 33%.\nBenötigt Essenz des Feuers (8), Essenz der Erde (8), Essenz der Luft (8), Essenz des Wassers (8), Essenz des Lebens (8), Schwarzes Vitriol (2), Schwarzer Lotus (4)"},
[13518] = {name = "[q2]Rezept: Fläschchen der Versteinerung", additional_info = "Benötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Fläschchens der Versteinerung.\nFläschchen der Versteinerung\nBenötigt Stufe 50\n[q2]Benutzen: Ihr werdet zu Stein und seid 1 min lang gegen alle körperlichen Angriffe und Zauber geschützt, allerdings könnt Ihr während dieser Zeit weder angreifen noch Euch bewegen und auch keine Zauber wirken. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. (3 Sek. Abklingzeit)\nBenötigt Steinschuppenöl (30), Bergsilberweisling (10), Schwarzer Lotus , Kristallphiole"},
[13519] = {name = "[q2]Rezept: Fläschchen der Titanen", additional_info = "Benötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Fläschchens der Titanen.\nFläschchen der Titanen\nBenötigt Stufe 50\n[q2]Benutzen: Erhöht die maximale Gesundheit des Spielers 2 hrs lang um 1200. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. Dieser Effekt hält über den Tod hinaus an. (3 Sek. Abklingzeit)\nBenötigt Gromsblut (30), Steinschuppenöl (10), Schwarzer Lotus , Kristallphiole"},
[13520] = {name = "[q2]Rezept: Fläschchen mit destillierter Weisheit", additional_info = "Benötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Fläschchens destillierter Weisheit.\nFläschchen mit destillierter Weisheit\nBenötigt Stufe 50\n[q2]Benutzen: Erhöht das maximale Mana des Spielers 2 hrs lang um 2000. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. Dieser Effekt hält über den Tod hinaus an. (3 Sek. Abklingzeit)\nBenötigt Traumblatt (30), Eiskappe (10), Schwarzer Lotus , Kristallphiole"},
[13521] = {name = "[q2]Rezept: Fläschchen mit oberster Macht", additional_info = "Benötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Fläschchens der obersten Macht.\nFläschchen mit oberster Macht\nBenötigt Stufe 50\n[q2]Benutzen: Erhöht die Schadenswirkung von Zaubern und magischen Effekten 2 hrs lang um bis zu 150. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. Dieser Effekt hält über den Tod hinaus an. (3 Sek. Abklingzeit)\nBenötigt Traumblatt (30), Bergsilberweisling (10), Schwarzer Lotus , Kristallphiole"},
[13522] = {name = "[q2]Rezept: Fläschchen mit chromatischem Widerstand", additional_info = "Benötigt Alchimie (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Fläschchens des chromatischen Widerstandes.\nFläschchen mit chromatischem Widerstand\nBenötigt Stufe 50\n[q2]Benutzen: Erhöht Euren Widerstand gegen alle Arten von Magie 2 hrs lang um 25. Es kann immer nur der Effekt von jeweils einem Fläschchen aktiv sein. Dieser Effekt hält über den Tod hinaus an und ist mit allen anderen widerstandssteigernden Zaubern und Gegenständen stapelbar. (3 Sek. Abklingzeit)\nBenötigt Eiskappe (30), Bergsilberweisling (10), Schwarzer Lotus , Kristallphiole"},
