[16054] = {name = "[q2]Bauplan: Arkanitdrachling", additional_info = "Benötigt Ingenieurskunst (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines Arkanitdrachlings.\nGeplündert von: Kobaltblauer Magiewirker\nDropchance: 2.29%\n[q3]Arkanitdrachling\nWird beim Anlegen gebunden\nEinzigartigSchmuck\nBenötigt Stufe 50\nBenötigt Ingenieurskunst (300)\n[q2]Benutzen: Aktiviert Euren Arkanitdrachling, damit er 1 min lang für Euch kämpft. Benötigt eine Stunde Abklingzeit, bevor ein erneuter Einsatz möglich wird. (1 Stunde Abklingzeit)\nBenötigt Mechanischer Mithrildrachling , Empfindlicher Arkanitwandler (8), Verzauberter Thoriumbarren (10), Thoriumapparat (6), Goldkraftkern (4), Verzaubertes Leder (6)"},
[16055] = {name = "[q2]Bauplan: Arkane Bombe", additional_info = "Benötigt Ingenieurskunst (300)\n[q2]Benutzen: Lehrt Euch die Herstellung einer arkanen Bombe.\nArkane Bombe\nBenötigt Ingenieurskunst (300)\n[q2]Benutzen: Zieht 675 to 1125 Punkt(e) Mana von allen ab, die sich im Umkreis des Schlages befinden und fügt dem Ziel einen Schaden in Höhe von 50% des abgezogenen Manas zu. Bringt die Ziele im Schlagbereich außerdem 5 sec lang zum Schweigen. (1 Min Abklingzeit)\nBenötigt Empfindlicher Arkanitwandler , Thoriumbarren (3), Runenstoff"},
[16056] = {name = "[q2]Bauplan: Fehlerloses Arkanitgewehr", additional_info = "Benötigt Ingenieurskunst (300)\n[q2]Benutzen: Lehrt Euch die Herstellung eines fehlerlosen Arkanitgewehrs.\n[q3]Fehlerloses Arkanitgewehr\nWird beim Anlegen gebunden\nDistanz Schusswaffe\n65 - 122 Schaden Tempo 3.00\n(31.17 Schaden pro Sekunde)\nHaltbarkeit 75 / 75\nBenötigt Stufe 56\n[q2]Anlegen: Schusswaffen +4.\n[q2]Anlegen: +10 Distanzangriffskraft.\nBenötigt Arkanitbarren (10), Thoriumröhre (2), Essenz des Feuers (2), Essenz der Erde (2), Azerothianischer Diamant (2), Verzaubertes Leder (2)"},
