[191280] = {name = "[q3]Pilzsporenansammlung", additional_info = "Wird beim Aufheben gebunden\nDauer: 7 tagen\n[q2]Benutzen: Gewährt Euren offensiven Fähigkeiten eine Chance, eine Spore zu beschwören, die Spielercharaktere in der Nähe mit 'Pilzwucher' belegt, wenn sie getötet wird. Dieser Effekt hält 1 hour lang an.\n\nPilzwucher \nVerursacht alle 1 Sek. 150 Naturschaden und erhöht die Chance auf einen kritischen Treffer mit Nahkampf-, Distanzangriffen und Zaubern um 15%. (Procchance: 10%, 15s Abklingzeit)"},
