[191660] = {name = "[q3]Thaddius' Blitzbolzen", additional_info = "Wird beim Aufheben gebunden\nDauer: 7 tagen\n[q2]Benutzen: Bringt die Bolzen an Eurem Hals an, sodass sie zufällig eine positive oder negative Ladung anwenden, die Schaden und Heilung um 1% erhöht.\n\n Dieser Effekt wird gestapelt, wenn sich Verbündete mit einer ähnlichen Ladung in der Nähe befinden, und fügt Verbündeten mit einer entgegengesetzten Ladung Naturschaden zu."},
[191661] = {name = "[q3]Monströser Spinnenfangzahn", additional_info = "Wird beim Aufheben gebunden\nDauer: 7 tagen\n[q2]Benutzen: Stecht Euch mit dem Fangzahn, was die Bewegungsgeschwindigkeit, das Angriffstempo und das Zaubertempo 1 hour lang um 15% erhöht. (Procchance: 5%, 30s Abklingzeit)"},
