[202251] = {name = "Tüte mit Leckerlis", additional_info = "Wird beim Aufheben gebunden\n[q2]Benutzen: Öffnet den Leckerlibeutel und steckt ihn in die Tasche Eures Ziels. Dadurch wird der Schaden, den Wildtiere diesem Ziel zufügen, um 20 erhöht. (1 Min Abklingzeit)"},
[202254] = {name = "[q3]Armschienen der Umlenkung", additional_info = "Wird beim Anlegen gebunden\nHandgelenke Leder\n44 Rüstung\n+11 Ausdauer\n+13 Intelligenz\n+8 Willenskraft\nHaltbarkeit 35 / 35\nBenötigt Stufe 60\n[q2]Anlegen: Erhöht Eure Chance, einen kritischen Treffer durch Zauber zu erzielen, um 1%."},
[202256] = {name = "[q2]Verzierte Pistole des Freibeuters", additional_info = "Wird beim Aufheben gebunden\nDistanz Schusswaffe\n6 - 13 Schaden Tempo 1.90\n(5.00 Schaden pro Sekunde)\nHaltbarkeit 35 / 35Klassen: Schurke\n[q2]Anlegen: Erhaltet die Fähigkeit 'Pistolenheld':\n\n\nZieht Eure Fernkampfwaffe und feuert einen Schnellschuss auf einen Gegner ab, der normalen Distanzwaffenschaden verursacht und die Bewegungsgeschwindigkeit des Ziels 6 sec lang um 50% verringert. Gewährt 1 Combopunkt.\n\n 'Pistolenheld' profitiert von allen Talenten und Effekten, die durch 'Finsterer Stoß' ausgelöst werden oder 'Finsterer Stoß' modifizieren."},
[202641] = {name = "Schlammbedecktes Notizbuch.", additional_info = "Wird beim Aufheben gebunden\nDieser Gegenstand startet eine Quest.Klassen: Schurke"},
[203723] = {name = "Schnittis Notiz", additional_info = "Wird beim Aufheben gebunden\nKlassen: Schurke\n[q2]<Zum Lesen rechtsklicken>"},
[203726] = {name = "[q2]Schnittis Rune", additional_info = "Klassen: Schurke"},
[203745] = {name = "[q2]Zaubernotizen: Eislanze", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\nBenötigtRunenschnitzen\n(1)\n[q2]Prägt Eure Handschuhe mit der Rune 'Eislanze':\n\n\nFügt einem gegnerischen Ziel [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100] Frostschaden zu. Eingefrorene Ziele erleiden dreifachen Schaden."},
[203746] = {name = "[q2]Zaubernotizen: Lebende Flamme", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\nBenötigtRunenschnitzen\n(1)\n[q2]Prägt Eure Hosen mit der Rune 'Lebende Flamme':\n\n\nBeschwört eine Zauberfeuerflamme, die sich auf das Ziel zubewegt und einen Pfad aus Zauberfeuer hinterlässt. Dieser Pfad fügt Gegnern in der Nähe pro Sekunde [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100] Zauberfeuerschaden zu. Hält 20 sec lang an."},
[203747] = {name = "[q2]Zaubernotizen: Eisige Finger", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\nBenötigtRunenschnitzen\n(1)\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Eisige Finger':\n\n\nVerleiht Euren Kälteeffekten eine Chance von 15%, den Effekt 'Eisige Finger' hervorzurufen. Die eisigen Finger bewirken, dass Eure nächsten 2 gewirkten Zauber einen Effekt haben, den sie auf ein gefrorenes Ziel hätten. Hält 15 sec lang an."},
[203748] = {name = "[q2]Zaubernotizen: Feuerfontäne", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Euer Brustteil mit der Rune 'Feuerfontäne':\n\n\nErhöht die kritische Trefferchance aller Eurer Zauber um 15%, aber die kritischen Treffer Eurer Zauber ohne regelmäßige Effekte kosten zusätzlich 1% eures Grundmanas."},
[203749] = {name = "[q2]Zaubernotizen: Erleuchtung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Erleuchtung':\n\n\nIhr verursacht 10% mehr Schaden, solange Ihr mehr als 70% Mana habt. Während Ihr weniger als 30% Mana habt, beträgt Eure Manaregeneration während des Zauberwirkens 10%."},
[203750] = {name = "Schatzkarte von Elwynn", additional_info = "Wird beim Aufheben gebunden\nKlassen: Schurke\n[q2]Benutzen: Gräbt einen Schatz an dem markierten Ort aus. (1 Min Abklingzeit)"},
[203751] = {name = "[q2]Zaubernotizen: NSZEIELA", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Benutzen: Entziffert die Zaubernotizen mit einer Verständnisfibel, um einen neuen Runenschnitzenzauber zu erlernen."},
[203752] = {name = "[q2]Zaubernotizen: DEELFANE LMEBM", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Benutzen: Entschlüsselt die Zaubernotizen mit einem Verständnisamulett, um einen neuen Runenschnitzenzauber zu erlernen."},
[203753] = {name = "[q2]Zaubernotizen: ENEGSG IERIFI", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Benutzen: Entschlüsselt die Zaubernotizen mit einem Verständnisamulett, um einen neuen Runenschnitzenzauber zu erlernen."},
