[203990] = {name = "[q2]Rune der Verstümmelung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Verstümmeln':\n\n\nGreift sofort mit beiden Waffen an, verursacht 100% Waffenschaden sowie mit jeder Waffe zusätzlich [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] Schaden. Der Schaden gegen vergiftete Ziele ist um 20% erhöht. Gewährt 2 Combopunkte.\n\n Sofern nicht anders angegeben, profitiert 'Verstümmeln' von allen Talenten und Effekten, die durch 'Meucheln' ausgelöst werden oder 'Meucheln' modifizieren."},
[203991] = {name = "[q2]Rune des Pistolenhelden", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Pistolenheld':\n\n\nZieht Eure Fernkampfwaffe und feuert einen Schnellschuss auf einen Gegner ab, der normalen Distanzwaffenschaden verursacht und die Bewegungsgeschwindigkeit des Ziels 6 sec lang um 50% verringert. Gewährt 1 Combopunkt.\n\n 'Pistolenheld' profitiert von allen Talenten und Effekten, die durch 'Finsterer Stoß' ausgelöst werden oder 'Finsterer Stoß' modifizieren."},
[203992] = {name = "[q2]Rune der Täuschung", additional_info = "Klassen: Schurke"},
[203993] = {name = "[q2]Rune des Abschlachtens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Hinterhältiger Mord':\n\n\nVerringert die Energiekosten Eurer Fähigkeiten 'Meucheln' und 'Hinterhalt' um 20.\n\nHandschuhe prägen - Verstümmeln\nGilt nicht für 'Verstümmeln'\n\n Gilt nicht für Fähigkeiten, die durch andere Runen erlernt wurden."},
[203994] = {name = "[q2]Rune der tödlichen Mischung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Tödliche Mischung':\n\n\nGewährt Euren Giften mehrere Verbesserungen:\n\n Wenn Ihr das Ziel mit irgendeinem anderen Gift vergiftet, belegt Ihr es auch mit tödlichem Gift.\n\n Wenn Eure Waffe mit keinem Gift überzogen ist, besteht eine Chance, dass sie sofort wirkendes Gift anwendet, als wäre sie mit sofort wirkendem Gift überzogen.\n\n Der Schaden des tödlichen Gifts und des sofort wirkenden Gifts wird nun durch Eure Angriffskraft erhöht."},
[204174] = {name = "[q2]Rune der Präzision", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Hosen mit der Rune 'Zwischen die Augen':\n\n\nFinishing-Move für den Distanzkampf, der durch Angriffskraft erhöhten Schaden pro Combopunkt verursacht und das Ziel betäubt:\n\n 1 Punkt: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] Schaden, 1 Sek. Betäubung\n 2 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] Schaden, 2 Sek. Betäubung\n 3 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] Schaden, 3 Sek. Betäubung\n 4 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] Schaden, 4 Sek. Betäubung\n 5 Punkte: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] bis [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] Schaden, 5 Sek. Betäubung\n\n Teilt sich die Abklingzeit mit 'Nierenhieb'."},
