[204703] = {name = "[q2]Rune der Verwüstung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Handschuhe mit der Rune 'Verwüsten':\n\n\nWährend Ihr Euch in der 'Verteidigungshaltung' befindet und einen Schild tragt, verursacht 'Rüstung zerreißen' zusätzlich pro Sekunde Schaden in Höhe von 150% des Schadens Eurer ausgerüsteten Waffe. Dieser Effekt ist pro Stapel von 'Rüstung zerreißen', der bereits auf dem Ziel ist, um 10% erhöht."},
[204716] = {name = "[q2]Rune des rasenden Angriffs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Hosen mit der Rune 'Rasender Angriff':\n\n\nWährend Ihr Zweihandwaffen tragt, ist Euer Angriffstempo um 20% erhöht."},
[204795] = {name = "[q2]Rune des Schattenschlags", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Schattenschlag':\n\n\nTeleportiert Euch hinter Euer Ziel und schlägt zu, um ihm 150% Waffenschaden zuzufügen. Muss im Verstohlenheitsmodus sein. Gewährt 1 Combopunkt."},
[204804] = {name = "[q3]Hydraxianische Reifen", additional_info = "Wird beim Aufheben gebunden\nHandgelenke Kette\n95 Rüstung\n+4 Stärke\n+7 Ausdauer\nHaltbarkeit 40 / 40\nBenötigt Stufe 25"},
[204806] = {name = "[q2]Rune des Siegesrauschs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Handschuhe mit der Rune 'Siegesrausch':\n\n\nGreift das Ziel sofort an. Verursacht (1 + Attack power * 45 / 100) Schaden und heilt Euch um 10% Eurer maximalen Gesundheit. Kann nur innerhalb von 20 sec, nachdem Ihr einen Gegner getötet habt, der Erfahrung oder Ehre gewährt, eingesetzt werden."},
[204807] = {name = "[q3]Tiefenklinge", additional_info = "Wird beim Aufheben gebunden\nZweihändig Schwert\n71 - 107 Schaden Tempo 3.60\n(24.72 Schaden pro Sekunde)\nHaltbarkeit 100 / 100\nBenötigt Stufe 25\n[q2]Trefferchance: Trifft alle Gegner vor Euch mit einem Schwall Druckwasser.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
[204809] = {name = "[q2]Rune des wütenden Donners", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Hosen mit der Rune 'Wütender Donner':\n\n\nThunder Clap now increases the time between attacks by an additional 6%, can be used in any stance, deals 100% increased damage, and deals 50% increased threat."},
[204864] = {name = "[q2]Notizen eines Lehrlings aus Azora", additional_info = "Wird beim Aufheben gebunden\nEinzigartig (6)\n[q2]Benutzen: Kombiniert 6 Notizen eines Lehrlings aus Azora, um eine neue Runenschnitzenvorlage zu erschaffen."},
