[204912] = {name = "[q2]Rune der Anmut", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Hosen mit der Rune 'Dämonische Anmut':\n\n\nEin Anstieg der Teufelsenergie erhöht Eure Ausweichchance und die Eures Begleiters um 30% und Eure Chance, mit allen Angriffen kritisch zu treffen, um 30%. Hält 6 sec lang an."},
[205019] = {name = "Besudelter Seelensplitter", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[205020] = {name = "Reiner Seelensplitter", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[205022] = {name = "[q2]Rune des Seelenentzugs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Seelenentzug':\n\n\nErhöht die durch Eure Zauber 'Blutsauger' und 'Seelendieb' abgezogene Menge um zusätzliche 6% für jeden Eurer Hexenmeister-Schatteneffekte, von dem das Ziel betroffen ist, bis zu einem zusätzlichen Effekt von maximal 18%."},
[205181] = {name = "Nicht identifiziertes Artefakt", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[205182] = {name = "Machtloses Artefakt", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]Benutzen: Opfert Euer Blut, um das Artefakt zu ermächtigen."},
[205183] = {name = "Teufelsverstärktes Artefakt", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[205184] = {name = "Notiz eines Akolythen", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]<Zum Lesen rechtsklicken>"},
[205215] = {name = "[q2]Rune der Taktiken", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Dämonische Taktiken':\n\n\nErhöht die Chance für einen kritischen Nahkampf- oder Zaubertreffer von Euch und Eurem Dämon um 10%."},
[205218] = {name = "[q2]Buchband der Entdeckung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Buchband\nKlassen: Paladin\nBenötigt Stufe 5\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Seelenentzug':\n\n\nErhöht die durch Eure Zauber 'Blutsauger' und 'Seelendieb' abgezogene Menge um zusätzliche 6% für jeden Eurer Hexenmeister-Schatteneffekte, von dem das Ziel betroffen ist, bis zu einem zusätzlichen Effekt von maximal 18%."},
[205228] = {name = "[q2]Rune des Chaosblitzes", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Handschuhe mit der Rune 'Chaosblitz':\n\n\nSchleudert einen Blitz chaotischen Feuers auf den Gegner und fügt ihm [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 522 / 100] bis [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 662 / 100] Feuerschaden zu. 'Chaosblitz' trifft immer, dem Zauber kann nicht widerstanden werden und sein Wissen sorgt dafür, dass alle Eure Feuerzauber Absorptionseffekte durchschlagen. Es besteht eine hohe Chance, dass dem 'Chaosblitz' widerstanden wird, wenn er gegen Monster eingesetzt wird, die mehr als 3 Stufen über Euch sind."},
[205230] = {name = "[q2]Rune der Heimsuchung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Handschuhe mit der Rune 'Heimsuchung':\n\n\nJagt eine geisterhafte Seele auf den Gegner, die [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100] bis [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100] Schaden verursacht und sämtlichen regelmäßigen Schattenschaden, den Ihr dem Ziel zufügt, um 20% erhöht. Wenn 'Heimsuchung' endet oder gebannt wird, werdet Ihr in Höhe des Schadens geheilt, die der Zauber dem Ziel zugefügt hat."},
[205364] = {name = "Knappsack des Akolythen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]<Zum Öffnen rechtsklicken>"},
[205420] = {name = "[q2]Buchband des Richturteils", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Buchband\nKlassen: Paladin\n[q2]Prägt Eure Handschuhe mit der Rune 'Kreuzfahrerstoß':\n\n\nAn instant strike that causes 75% weapon damage as Holy and regenerates 5% of your maximum mana."},
[205683] = {name = "[q2]Rune der Zurechtweisung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Eure Hosen mit der Rune 'Zurechtweisung':\n\n\nUnterbricht das Wirken von Zaubern und verhindert 3 sec lang, dass Zauber dieser Art gewirkt werden können."},
[205685] = {name = "[q2]Rune der Aegis", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Euer Brustteil mit der Rune 'Aegis':\n\n\nErhöht Euren Blockwert um 30%. Nahkampf- und Distanzangriffe gegen Euch haben eine Chance von 10%, Eure Blockchance um 30% zu erhöhen. Hält 10 sec lang an oder bis 5-mal geblockt wurde. Der Effekt ist nicht stapelbar mit 'Verschanzen'."},
[205863] = {name = "Verderbter Buchband", additional_info = "Klassen: Paladin"},
[205864] = {name = "Verkohlte Notiz", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]<Zum Lesen rechtsklicken>"},
[205897] = {name = "[q2]Rune des Märtyrertums", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Euer Brustteil mit der Rune 'Siegel des Märtyrertums':\n\n\nFills you with holy spirit for 30 sec, causing each of your melee attacks to deal 50% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 20% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 85% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\n This ability's Seal and Judgement benefit from talents and effects that modify the Seal or Judgement of Seal of Righteousness."},
[205905] = {name = "[q2]Erinnerung an einen ergebenen Champion", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Okkultismus':\n\n\n'Gedankenschinden' und 'Gedankenschlag' verursachen 50% mehr Schaden, wenn das Ziel von Eurem 'Schattenwort: Schmerz' betroffen ist.\n[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205932] = {name = "[q2]Prophezeiung des Tods eines Königs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Handschuhe mit der Rune 'Schattenwort: Tod':\n\n\nEin Wort der bindenden Dunkelheit, das dem Ziel [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 320 / 100] bis [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 372 / 100] Schattenschaden zufügt. Wenn das Ziel durch 'Schattenwort: Tod' nicht stirbt, erleidet der Zaubernde Schaden in Höhe von 50% des Schadens, der dem Ziel zugefügt wurde.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[205940] = {name = "[q2]Erinnerung an einen dunklen Zweck", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Pest der Leere':\n\n\nInfiziert das Ziel mit einer Krankheit zu, die im Verlauf von 18 sec [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 129 / 100 * 6] Schattenschaden verursacht.\n[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205942] = {name = "Chimärische Offenbarung", additional_info = "[q2]Prägt Eure Hosen mit der Rune 'Gebet der Besserung':\n\n\nBelegt das Ziel mit einem Zauber, der es um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] Gesundheit heilt, wenn es das nächste Mal Schaden erleidet oder geheilt wird. Wird die Heilung ausgelöst, springt 'Gebet der Besserung' zu einem Gruppen- oder Schlachtzugsmitglied innerhalb von 20 Metern über. Springt bis zu 5-mal und hält nach jedem Sprung 30 sec lang an. Dieser Zauber kann nur auf einem Ziel gleichzeitig platziert werden."},
[205943] = {name = "Prophezeiung einer entweihten Zitadelle", additional_info = "Einzigartig\n[q2]Prägt Eure Hosen mit der Rune 'Homunculi':\n\n\nBricht Splitter aus Eurer Seele, um 3 Miniaturkopien von Euch zum Leben zu erwecken, die versuchen, Euer aktuelles Ziel mit einem Streitkolben, Schwert und einer Axt anzugreifen. Dadurch verringern sie das Angriffstempo, die Angriffskraft bzw. die Rüstung aller getroffenen Ziele.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[205944] = {name = "[q2]Gegenseitige Offenbarung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Hosen mit der Rune 'Gebet der Besserung':\n\n\nBelegt das Ziel mit einem Zauber, der es um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] Gesundheit heilt, wenn es das nächste Mal Schaden erleidet oder geheilt wird. Wird die Heilung ausgelöst, springt 'Gebet der Besserung' zu einem Gruppen- oder Schlachtzugsmitglied innerhalb von 20 Metern über. Springt bis zu 5-mal und hält nach jedem Sprung 30 sec lang an. Dieser Zauber kann nur auf einem Ziel gleichzeitig platziert werden."},
[205945] = {name = "[q2]Erinnerung an einen eingekerkerten Retter", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Hosen mit der Rune 'Geteilter Schmerz':\n\n\nEuer 'Schattenwort: Schmerz' wirkt jetzt zusätzlich auf bis zu 2 zusätzliche Ziele im Umkreis von 15 Metern.\n[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205946] = {name = "[q2]Erinnerung an den Verrat eines Anführers", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Stiefel mit der Rune 'Schmerzunterdrückung':\n\n\nVerringert sofort sämtlichen Schaden, den ein verbündetes Ziel erleidet, um 40% und erhöht den Widerstand gegen Bannzauber 8 sec lang um 65%.\n[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205947] = {name = "[q2]Prophezeiung einer entweihten Zitadelle", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Hosen mit der Rune 'Homunculi':\n\n\nBricht Splitter aus Eurer Seele, um 3 Miniaturkopien von Euch zum Leben zu erwecken, die versuchen, Euer aktuelles Ziel mit einem Streitkolben, Schwert und einer Axt anzugreifen. Dadurch verringern sie das Angriffstempo, die Angriffskraft bzw. die Rüstung aller getroffenen Ziele.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[205948] = {name = "Wohltuende Offenbarung", additional_info = nil},
[205949] = {name = "Vielfache Offenbarung", additional_info = "[q2]Prägt Eure Handschuhe mit der Rune 'Kreis der Heilung':\n\n\nHeilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 40 Metern um ihn herum um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] bis [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] Gesundheit."},
[205950] = {name = "[q2]Finstere Offenbarung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Handschuhe mit der Rune 'Gedankenbrand':\n\n\nLöst eine Explosion von Schattenmagie um das gegnerische Ziel aus, die allen Gegnern im Umkreis von 10 Metern 5 sec lang alle 1 Sek. [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] bis [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] Schattenschaden zufügt."},
[205951] = {name = "[q2]Erinnerung an einen besorgten Akolythen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Handschuhe mit der Rune 'Sühne':\n\n\nSchleudert eine Salve heiligen Lichts auf das Ziel, die einem Gegner [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100] Heiligschaden zufügt oder ein verbündetes Ziel sofort sowie 2 sec lang alle 1 Sek. um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100] Gesundheit heilt.\n[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205952] = {name = "Erinnerung an eine zerschmetterte Welt", additional_info = "[q2]Benutzen: Konzentriert Euch auf die Erinnerung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über die spirituellen Geheimnisse Azeroths geklärten Geist."},
[205953] = {name = "[q2]Prophezeiung eines gebrochenen Schwurs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euren Gürtel mit der Rune 'Gedankenstachel':\n\n\nFügt dem Ziel [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] bis [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] Schattenfrostschaden zu und erhöht die kritische Trefferchance Eures nächsten Einsatzes von 'Gedankenschlag' gegen das Ziel um 30%, bis zu 3-mal stapelbar.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[205961] = {name = "Vogelfleisch aus Mulgore", additional_info = "Einzigartig\n[q2]Benutzen: Platziert einen Köder in der Nähe eines Bergkatzenbaus."},
[205979] = {name = "[q2]Rune des Flankierens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Hosen mit der Rune 'Flankenangriff':\n\n\nIhr und Euer Tier verursacht sofort und gleichzeitig 100% Nahkampfschaden. Anschließend verursachen Euer 'Mungobiss' und 'Raptorstoß' 10 sec lang 10% mehr Schaden. Bis zu 3-mal stapelbar. 'Raptorstoß' hat eine Chance von 20%, die Abklingzeit von 'Flankenangriff' abzuschließen."},
[205995] = {name = "Präriehundmoschus", additional_info = "Klassen: Jäger\n[q2]Benutzen: Eure Fähigkeit 'Wildtier zähmen' wirkt auch bei Präriehunden (als Haustier). (10 Min Abklingzeit)"},
[206032] = {name = "[q2]Rune des Zerlegens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Handschuhe mit der Rune 'Zerlegen':\n\n\nEin weitreichender Angriff, der allen Gegnern vor Euch 65% Waffenschaden zufügt."},
[206155] = {name = "[q2]Rune der Treffsicherheit", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Meister der Treffsicherheit':\n\n\nErhöht Eure kritische Trefferchance um 5% und verringert die Manakosten aller Eurer Schussfähigkeiten um 25%."},
[206157] = {name = "Zephyriumbergbauladung", additional_info = "Questgegenstand\nEinzigartig (5)"},
[206159] = {name = "Verkleidung der Venture Co.", additional_info = "Questgegenstand"},
[206168] = {name = "[q2]Rune der Chimäre", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Handschuhe mit der Rune 'Schimärenschuss':\n\n\nVerursacht 120% Waffenschaden, erneuert die Dauer des auf das Ziel wirkenden Stiches oder Bisses und löst einen Effekt aus:\n\n Schlangenbiss - Verursacht sofort 48% des von Eurem 'Schlangenbiss' verursachten Schadens.\n\n Vipernbiss - Stellt sofort 60% des von Eurem 'Vipernbiss' aufgebrauchten Manas bei Euch wieder her.\n\n Skorpidstich - Versucht, das Ziel 10 sec lang zu entwaffnen. Dieser Effekt kann nur einmal pro Minute auftreten."},
[206169] = {name = "[q2]Rune des Explosivschusses", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Handschuhe mit der Rune 'Explosivschuss':\n\n\nFeuert ein Explosivgeschoss in das gegnerische Ziel, das allen Gegnern innerhalb von 8 Metern [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] bis [Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] Feuerschaden zufügt. Die Sprengladung verursacht 2 sec lang pro Sekunde weiteren Schaden."},
[206170] = {name = "Windzornzapfen", additional_info = "Questgegenstand"},
[206175] = {name = "Piniensalbe", additional_info = "Questgegenstand\nEinzigartig"},
[206176] = {name = "Mörser und Stößel", additional_info = "Questgegenstand\nEinzigartig\n[q2]Benutzen: Zerstampft 8 Windzornzapfen, um eine giftige Waffensalbe herzustellen. Theoretisch."},
[206177] = {name = "Pinienkernbutter", additional_info = "Wird beim Aufheben gebunden\n[q2]Benutzen: Stellt im Verlauf von 18 sec 61.2 Punkt(e) Gesundheit wieder her. Ihr müsst beim Essen sitzen bleiben. Wenn Ihr mindestens 10 Sekunden lang mit Essen verbringt, werdet Ihr satt und erhaltet 15 min lang 2 Punkt(e) Ausdauer und Willenskraft."},
[206264] = {name = "[q2]Rune der Inspiration", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Eure Hosen mit der Rune 'Inspirationsvorbild':\n\n\nEure inspirierende Präsenz bannt regelmäßig Furcht- und Schlafeffekte von Gruppenmitgliedern in der Nähe."},
[206344] = {name = "Messersatz", additional_info = "Questgegenstand\nEinzigartig\n[q2]Benutzen: Versucht, einen rohen glänzenden Kleinfisch zu filetieren."},
[206345] = {name = "Fischstücke", additional_info = "Questgegenstand\nEinzigartig"},
[206376] = {name = "[q2]Bollwerksymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Schildmeisterschaft':\n\n\nJedes Mal, wenn Ihr blockt, regeneriert Ihr Mana in Höhe von 8% Eures maximalen Manas und erhaltet Rüstung in der Höhe von 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar. Ihr erhaltet außerdem immer eine um 10% erhöhte Blockchance und einen um 15% erhöhten Blockwert."},
[206381] = {name = "[q2]Dyadisches Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Überladung':\n\n\nVerleiht Euren Zaubern 'Blitzschlag', 'Kettenblitzschlag', 'Kettenheilung', 'Welle der Heilung' und 'Lavaeruption' eine Chance von 50%, kostenlos einen zweiten, ähnlichen Zauber auf das gleiche Ziel auszulösen. Dieser verursacht nur halben Schaden bzw. halbe Heilung und erzeugt keine Bedrohung."},
[206382] = {name = "[q2]Orkansymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 20\n[q2]Prägt Eure Handschuhe mit der Rune 'Wasserschild':\n\n\nDer Zaubernde wird von 3 Wasserkugeln umgeben, die alle 5 Sek. 1% Eures maximalen Manas gewähren. Trifft ein Zauber-, Nahkampf- oder Distanzangriff den Zaubernden, werden 4% seines maximalen Manas wiederhergestellt und eine Wasserkugel wird aufgelöst. Alle paar Sekunden kann nur eine Wasserkugel aktiviert werden. Hält 10 min lang an. Es kann immer nur ein Elementarschild auf dem Schamanen aktiv sein."},
[206383] = {name = "[q2]Lithisches Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Hosen mit der Rune 'Erdschild':\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% Â and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. Â This effect can only occur once every few seconds. Â 9 charges. Lasts 10 min. Â Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time."},
[206384] = {name = "[q2]Astralsymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3"},
[206385] = {name = "[q2]Klastisches Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Hosen mit der Rune 'Weg der Erde':\n\n\nWährend 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist, verursacht Ihr 50% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit, aber seine Reichweite wird auf Nahkampfreichweite reduziert."},
[206386] = {name = "[q2]Galvanisches Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Schildmeisterschaft':\n\n\nJedes Mal, wenn Ihr blockt, regeneriert Ihr Mana in Höhe von 8% Eures maximalen Manas und erhaltet Rüstung in der Höhe von 30% des Rüstungswertes Eures Schildes. Bis zu 5-mal stapelbar. Ihr erhaltet außerdem immer eine um 10% erhöhte Blockchance und einen um 15% erhöhten Blockwert."},
[206387] = {name = "[q2]Kajarisches Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\n[q2]Prägt Eure Handschuhe mit der Rune 'Lavaeruption':\n\n\nIhr schleudert flüssige Lava auf das Ziel, die [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] bis [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] Feuerschaden verursacht. Wenn das Ziel von 'Flammenschock' betroffen ist, wird 'Lavaeruption' einen kritischen Treffer erzielen."},
[206388] = {name = "[q2]Schwefliges Symbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Handschuhe mit der Rune 'Schmelzschlag':\n\n\nÜberzieht bis zu 4 Gegner in einem kegelförmigen Bereich vor Euch mit [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power] bis [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power] Feuerschaden. Diese Fähigkeit generiert eine große Menge Bedrohung. Der regelmäßige Schaden von 'Flammenschock' hat eine Chance von 10%, die Abklingzeit von 'Schmelzschlag' abzuschließen."},
[206389] = {name = "[q2]Schwefelsymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Euren Gürtel mit der Rune 'Feuernova':\n\n\nEuer Totem der Feuernova wird durch 'Feuernova' ersetzt. Dadurch verursacht Euer derzeitiges Feuertotem Schaden an seinem Standort."},
[206390] = {name = "[q2]Ichthyosymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Handschuhe mit der Rune 'Wasserschild':\n\n\nDer Zaubernde wird von 3 Wasserkugeln umgeben, die alle 5 Sek. 1% Eures maximalen Manas gewähren. Trifft ein Zauber-, Nahkampf- oder Distanzangriff den Zaubernden, werden 4% seines maximalen Manas wiederhergestellt und eine Wasserkugel wird aufgelöst. Alle paar Sekunden kann nur eine Wasserkugel aktiviert werden. Hält 10 min lang an. Es kann immer nur ein Elementarschild auf dem Schamanen aktiv sein."},
[206391] = {name = "[q2]Syzygiensymbol", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Totem\nKlassen: Schamane\nBenötigt Stufe 3"},
[206466] = {name = "Präriekrone", additional_info = "[q2]Benutzen: Erweckt einen Geist der Ebenen."},
[206469] = {name = "Prärieblume", additional_info = "Klassen: Druide\n[q2]Benutzen: Verflechtet 3 Prärieblumen zu einer Krone."},
[206954] = {name = "[q2]Götze der Bärenwut", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\nBenötigt Stufe 10\n[q2]Prägt Eure Handschuhe mit der Rune 'Zerfleischen':\n\n\nZerfleischt das Ziel, fügt ihm 160% des normalen Schadens zu und lässt es 1 min lang 30% zusätzlichen Schaden durch Blutungseffekte und 'Schreddern' erleiden. Diese Fähigkeit profitiert von allen Effekten von 'Klaue' und 'Zermalmen' und löst diese aus."},
[206963] = {name = "[q2]Rune des Naturpotenzials", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Samenkorn des Lebens':\n\n\nWenn Ihr mit Euren Heilzaubern einen kritischen Treffer erzielt, pflanzt Ihr dem Ziel für 50% des geheilten Wertes ein 'Samenkorn des Lebens' ein. Das Samenkorn wird erblühen, wenn das Ziel das nächste Mal Schaden erleidet oder nicht regelmäßige Heilung erhält. Hält 15 sec lang an."},
[206966] = {name = "Satyrkrautknolle", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[206970] = {name = "[q2]Rune des Lebens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Eure Hosen mit der Rune 'Blühendes Leben':\n\nVerringert die globale Abklingzeit Eurer Fähigkeiten 'Verjüngung' und 'Blühendes Leben' um 0.5 Sek. und Ihr erhaltet die Fähigkeit 'Blühendes Leben':\n\n\nHeilt das Ziel im Verlauf von 7 sec um [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit. Wenn 'Blühendes Leben' endet oder gebannt wird, wird das Ziel sofort um [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] Gesundheit geheilt und der Druide erhält die Hälfte der Zauberkosten erstattet. Dieser Effekt ist bis zu 3-mal auf einem Ziel stapelbar."},
[206975] = {name = "Artefaktlagertruhenschlüssel", additional_info = "Einzigartig"},
[206985] = {name = "[q2]Echo des Alphas", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Stiefel mit der Rune 'Geist des Alphas':\n\n\nInfuses the target with the spirit of an alpha wolf, increasing all threat generated by the target by 45% for 30 min. Limit 1 target. If cast on a target other than self, the Shaman also gains Loyal Beta, increasing Attack Power by 20% for 30 min. A target cannot have both Spirit of the Alpha and Loyal Beta at the same time."},
[206989] = {name = "[q2]Rune der Sonne", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Eure Handschuhe mit der Rune 'Sonnenfeuer':\n\n\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu.\n\n Außerdem wird, während Ihr in Bärengestalt, Katzengestalt oder Terrorbärengestalt seid, Euer 'Mondfeuer' durch 'Sonnenfeuer (Bär)' oder 'Sonnenfeuer (Katze)' ersetzt. Dieser Zauber profitiert von allen Effekten von 'Mondfeuer' und löst diese aus.\n\n 'Sonnenfeuer (Bär)'\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu.\n\n 'Sonnenfeuer (Katze)'\nVerbrennt den Gegner und fügt ihm [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] bis [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] Naturschaden sowie im Verlauf von 12 sec [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] zusätzlichen Naturschaden zu. Generiert 1 Combopunkt."},
[206992] = {name = "[q2]Rune des Schädelstoßes", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Eure Hosen mit der Rune 'Schädelstoß':\n\n\nStürmt auf ein Ziel innerhalb von 13 Metern zu und schlagt ihm gegen den Schädel, was das Wirken von Zaubern unterbricht und 2 sec lang verhindert, dass Zauber dieser Art gewirkt werden können. Gemeinsame Abklingzeit mit 'Wilde Attacke'."},
