[208414] = {name = "[q2]Mondgötze", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\nBenötigt Stufe 4\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Furor von Sturmgrimm':\n\n\nVerringert die Manakosten von 'Zorn' um 100%. Jedes Mal, wenn Ihr Schaden mit 'Zorn' verursacht, besteht eine Chance von 12%, dass Eure nächste 'Heilende Berührung' innerhalb von 15 sec ein Spontanzauber ist und in allen Gestaltwandelgestalten einsetzbar ist."},
