[208682] = {name = "Verlassenes Schnappkieferei", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide"},
[208687] = {name = "[q2]Rune des Aufschlitzens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Eure Handschuhe mit der Rune 'Aufschlitzen':\n\n\nSchlitzt ein gegnerisches Ziel auf, was im Verlauf von 15 sec [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] Blutungsschaden und pro existierender Anwendung von 'Aufschlitzen' auf dem Ziel 20% Waffenschaden verursacht. Generiert hohe Bedrohung. Dieser Effekt ist bis zu 5-mal auf demselben Ziel stapelbar."},
[208689] = {name = "[q2]Wilder Götze", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\nBenötigt Stufe 20\n[q2]Prägt Eure Hosen mit der Rune 'Wildes Brüllen':\n\n\nFinishing-Move, der den verursachten körperlichen Schaden in Katzengestalt um 30% erhöht. Hält pro Combopunkt länger an:\n 1 Punkt: 14 Sek.\n 2 Punkte: 19 Sek.\n 3 Punkte: 24 Sek.\n 4 Punkte: 29 Sek.\n 5 Punkte: 34 Sek."},
[208701] = {name = "[q2]Rune des Meisters der Tiere", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Handschuhe mit der Rune 'Meister der Tiere':\n\n\nErhöht Schaden und Gesundheit Eures Tiers um 20% und seine Fokusregeneration um 50%. Außerdem verspottet das 'Knurren' Eures Tiers das Ziel 3 sec lang."},
[208739] = {name = "Kriegsbanner der Horde", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger"},
[208741] = {name = "[q2]Rune der endlosen Wut", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Handschuhe mit der Rune 'Endlose Wut':\n\n\nIhr erhaltet 25% mehr Wut durch sämtlichen von Euch verursachten Schaden."},
[208743] = {name = "Seele der Gier", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister"},
[208744] = {name = "[q2]Rune der Schattenblitze", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Handschuhe mit der Rune 'Schattenblitzsalve':\n\n\nEuer 'Schattenblitz' trifft jetzt bis zu 5 Ziele in einer Kette innerhalb von 10 Metern, aber mit um 20% verringertem Schaden."},
[208749] = {name = "Kistenschlüssel der Knarzklauen", additional_info = "Einzigartig"},
[208750] = {name = "[q2]Rune des Kanalisierens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Meisterkanalisierer':\n\n\nEuer Zauber 'Blutsauger' wird nicht mehr kanalisiert, hält 15 sec lang an mit einer Abklingzeit von 15 sec, kostet 100% mehr Mana und heilt Euch jedes Mal, wenn er Schaden verursacht, um 50% mehr."},
[208753] = {name = "[q2]Zaubernotizen: Regeneration", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Regeneration':\n\n\nHeilt das Ziel im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt es für 30 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[208754] = {name = "[q2]Zaubernotizen: TENGIRONEERA", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Benutzen: Entschlüsselt die Zaubernotizen mit einem Verständnisamulett, um einen neuen Runenschnitzenzauber zu erlernen."},
[208758] = {name = "[q2]Irdene Rune", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Prägt Eure Hosen mit der Rune 'Weg der Erde':\n\n\nWährend 'Waffe des Felsbeißers' auf Eurer Waffenhand aktiv ist, verursacht Ihr 50% mehr Bedrohung, erhaltet 30% mehr Gesundheit, erleidet 10% weniger Schaden. Eure Chance, von Nahkampfangriffen kritisch getroffen zu werden, ist um 6% verringert. Euer 'Erdschock' verspottet Ziele, damit sie Euch angreifen, und hat eine von anderen Schockzaubern getrennte Abklingzeit, aber seine Reichweite wird auf Nahkampfreichweite reduziert."},
[208760] = {name = "Lichtungskrone", additional_info = "[q2]Benutzen: Erweckt einen Geist der Ebenen."},
[208764] = {name = "[q2]Rune der Gedanken", additional_info = "EinzigartigKlassen: Priester\n[q2]Prägt Euren Gürtel mit der Rune 'Gedankenstachel':\n\n\nFügt dem Ziel [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] bis [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] Schattenfrostschaden zu und erhöht die kritische Trefferchance Eures nächsten Einsatzes von 'Gedankenschlag' gegen das Ziel um 30%, bis zu 3-mal stapelbar."},
