[208767] = {name = "[q2]Rune der Besserung", additional_info = "EinzigartigKlassen: Priester\n[q2]Prägt Eure Hosen mit der Rune 'Gebet der Besserung':\n\n\nBelegt das Ziel mit einem Zauber, der es um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] Gesundheit heilt, wenn es das nächste Mal Schaden erleidet oder geheilt wird. Wird die Heilung ausgelöst, springt 'Gebet der Besserung' zu einem Gruppen- oder Schlachtzugsmitglied innerhalb von 20 Metern über. Springt bis zu 5-mal und hält nach jedem Sprung 30 sec lang an. Dieser Zauber kann nur auf einem Ziel gleichzeitig platziert werden."},
[208768] = {name = "Streichholzkästchen des Bukaniers", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke"},
[208771] = {name = "[q2]Rune des Klingentanzes", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Hosen mit der Rune 'Klingentanz':\n\n\nFinishing-Move, der Eure Parierchance um 10% erhöht. Hält pro Combopunkt länger an:\n\n 1 Punkt: 14 Sek.\n 2 Punkte: 18 Sek.\n 3 Punkte: 22 Sek.\n 4 Punkte: 26 Sek.\n 5 Punkte: 30 Sek."},
[208772] = {name = "[q2]Rune des Säbelhiebs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Säbelschlitzer':\n\n\nSchlitzt einen Gegner brutal auf, fügt ihm 100% Waffenschaden zu und lässt das Ziel 12 sec lang alle 2 Sek. (Attack power * 5 / 100) Blutungsschaden erleiden. Bis zu 3-mal stapelbar. Gewährt 1 Combopunkt.\n\n 'Säbelschlitzer' nutzt die Vorteile aller Talente und Effekte, die durch 'Finsterer Stoß' ausgelöst werden oder 'Finsterer Stoß' modifizieren.\nGeplündert von: Späher der Defias\nDropchance: 4.76%"},
[208773] = {name = "Fischfangharpune", additional_info = "Wird beim Aufheben gebunden\nKlassen: Krieger , Jäger\n[q2]Benutzen: Wirft die Harpune auf das Ziel (40 Meter Reichweite)."},
[208777] = {name = "[q2]Rune des Scharfschützen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Eure Hosen mit der Rune 'Scharfschützentraining':\n\n\nDie kritische Trefferchance Eurer Schussfähigkeiten ist um 10% erhöht, wenn Ihr Euch in den letzten 6 Sek. nicht bewegt habt."},
[208778] = {name = "[q2]Rune des rasanten Schlags", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Handschuhe mit der Rune 'Rasanter Schlag':\n\n\nEin tollkühner, sofortiger Nahkampfangriff mit Eurer Zweihandwaffe, der (Attack power * 10 / 100) bis (Attack power * 20 / 100) körperlichen Schaden verursacht. Diese Fähigkeit profitiert von allen Effekten von 'Heldenhafter Stoß' und löst diese aus."},
[208799] = {name = "[q2]Zaubernotizen: Lebende Bombe", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Eure Handschuhe mit der Rune 'Lebende Bombe':\n\n\nDas Ziel wird zu einer lebenden Bombe und erleidet im Verlauf von 12 sec [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] Feuerschaden. Nach Ablauf von 12 sec, oder wenn der Zauber gebannt wird, explodiert das Ziel und fügt allen Gegnern innerhalb von 10 Metern [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] Feuerschaden zu."},
