[208849] = {name = "[q2]Segensbuchband", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Buchband\nKlassen: Paladin\nBenötigt Stufe 4\n[q2]Prägt Euer Brustteil mit der Rune 'Horn von Lordaeron':\n\n\nDer Paladin stößt in das 'Horn von Lordaeron', was die gesamte Stärke und Beweglichkeit aller Gruppenmitglieder innerhalb von 30 Metern um 6 erhöht. Hält 2 min lang an. Schließt 'Segen der Macht' aus."},
[208851] = {name = "[q2]Gerechtigkeitsbuchband", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Buchband\nKlassen: Paladin\nBenötigt Stufe 8\n[q2]Prägt Eure Handschuhe mit der Rune 'Hand der Abrechnung':\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n Während Ihr diese Fähigkeit kennt, ist der Bedrohungsbonus von 'Zorn der Gerechtigkeit' auf 80% erhöht. Wenn Ihr von anderen Charakteren geheilt werdet, sorgt 'Zorn der Gerechtigkeit' dafür, dass Ihr Mana in Höhe von 25% der hervorgerufenen Heilung erhaltet. Zusätzlich wird Schaden, der Eure Gesundheit unter 35% senkt, um 20% verringert, während 'Zorn der Gerechtigkeit' aktiv ist. 'Zorn der Gerechtigkeit' bleibt aktiv, bis er abgebrochen wird."},
[208853] = {name = "[q2]Zaubernotizen: Hirnfrost", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\nBenötigtRunenschnitzen\n(1)\n[q2]Prägt Eure Stiefel mit der Rune 'Hirnfrost':\n\n\nEure Frostzauber mit Kälteeffekten haben eine Chance von 15%, Euer nächstes Wirken von 'Feuerball', 'Zauberfrostblitz' oder 'Frostfeuerblitz' zu einem Spontanzauber werden zu lassen, der kein Mana kostet."},
