[210195] = {name = "[q2]Unausgewuchteter Götze", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\nBenötigt Stufe 10\n[q2]Benutzen: Gleicht die Mächte des Mondes, des Smaragdgrünen Traums und der Wildnis aus, um eine neue Fähigkeit zu erlernen."},
