[210229] = {name = "[q2]Rune der Verstümmelung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Verstümmeln':\n\n\nGreift sofort mit beiden Waffen an, verursacht 100% Waffenschaden sowie mit jeder Waffe zusätzlich [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] Schaden. Der Schaden gegen vergiftete Ziele ist um 20% erhöht. Gewährt 2 Combopunkte.\n\n Sofern nicht anders angegeben, profitiert 'Verstümmeln' von allen Talenten und Effekten, die durch 'Meucheln' ausgelöst werden oder 'Meucheln' modifizieren."},
[210250] = {name = "Gravierter Goldring", additional_info = "Wird beim Aufheben gebunden\nEinzigartigFinger"},
[210251] = {name = "Gravierter Silberring", additional_info = "Wird beim Aufheben gebunden\nEinzigartigFinger"},
[210252] = {name = "[q2]Rune der Klinge", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Tückische Klinge':\n\n\nGreift das Ziel sofort mit Eurer Schildhandwaffe an und fügt ihm den normalen Schaden dieser Waffe zu. Außerdem besteht eine Chance von 100%, das Ziel mit dem Gift Eurer Schildhandwaffe zu belegen. Gewährt 1 Combopunkt.\n\n 'Tückische Klinge' nutzt die Vorteile aller Talente und Effekte, die durch 'Finsterer Stoß' ausgelöst werden oder 'Finsterer Stoß' modifizieren."},
[210253] = {name = "[q2]Verfalltotem", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]Benutzen: Ruft die Geister der Elemente an."},
[210322] = {name = "[q2]Rune des Toxins", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Hosen mit der Rune 'Vergiften':\n\n\nFinishing-Move, der sofort Giftschaden abhängig von Euren Dosen 'Tödliches Gift' auf dem Ziel verursacht. Nach einem Angriff mit 'Vergiften' ist die Frequenz, mit der das Ziel mit 'Sofort wirkendes Gift' belegt werden kann, für 1 Sek. plus je 1 weitere Sekunde pro Combopunkt um 75% erhöht. Pro Combopunkt wird eine Dosis aktiviert:\n 1 Dosis: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09] Schaden\n 2 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18] Schaden\n 3 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27] Schaden\n 4 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36] Schaden\n 5 Dosen: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45] Schaden"},
[210323] = {name = "Tresorkombination", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke"},
[210329] = {name = "Hillsbradschatzkarte", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke"},
[210330] = {name = "Heißer Tipp", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]<Zum Öffnen rechtsklicken>"},
[210410] = {name = "Süßwasserschnapperköder", additional_info = "Klassen: Jäger\n[q2]Benutzen: Wirft einen Köder. (5 Min Abklingzeit)"},
[210499] = {name = "Moorcheln", additional_info = "[q2]Benutzen: Essen (auf eigene Gefahr)."},
[210500] = {name = "[q2]Rune der Sterne", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Eure Hosen mit der Rune 'Sternensog':\n\n\nEntfesselt eine Sogwelle stellarer Energien, die [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] bis [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] Arkanschaden verursacht und 15 sec lang für 1 Einsatz den verursachten Schaden von 'Sternenfeuer' um 80% erhöht.\n\n 'Sternensog' profitiert von den meisten Talenten und Effekten und löst diese aus, die auch 'Zorn' oder 'Sternenfeuer' auslösen oder davon profitieren."},
[210534] = {name = "[q2]Götze der Wildnis", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Wilde Stöße':\n\n\nWährend Ihr in Katzengestalt, Bärengestalt oder Terrorbärengestalt seid, erlangen Gruppenmitglieder im Umkreis von 20 Metern erhöhte Kampfwildheit. Bei jedem Nahkampftreffer besteht eine Chance von 20%, dem Angreifer einen Zusatzangriff mit 20% höherer Angriffskraft zu gewähren. Kein Effekt, wenn das Gruppenmitglied bereits vom Totem des Windzorns profitiert."},
[210568] = {name = "Schwächelndes Phylakterium", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[210569] = {name = "[q2]Rune der Geißelung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Euer Brustteil mit der Rune 'Geißelung':\n\n\nErhaltet nach dem Aktivieren von 'Blutrausch' oder 'Berserkerwut' 12 sec lang einen Bonus von 25% auf körperlichen Schaden."},
[210573] = {name = "[q2]Rune der verzehrenden Wut", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Hosen mit der Rune 'Von Wut zerfressen':\n\n\nVersetzt Euch in einen Wutzustand und gewährt Euch 12 sec lang oder für maximal 12 Schwünge einen Nahkampfschadensbonus von 10%, wann immer Ihr 80 Wut überschreitet."},
[210589] = {name = "[q2]Echo der Urahnen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\nBenötigt Stufe 3\n[q2]Prägt Eure Hosen mit der Rune 'Führung der Ahnen':\n\n\nFür die nächsten 10 sec werden 25% Eures Schadens in Heilung für bis zu 3 Gruppenmitglieder in der Nähe umgewandelt. 100% Eurer Heilung werden in Schaden umgewandelt und dem letzten Ziel von Eurem 'Flammenschock' zugefügt."},
[210596] = {name = "[q2]Rune der Kobrastöße", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Kobrastöße':\n\n\nEure kritischen Treffer mit Euren Schussfähigkeiten lassen die nächsten 2 Spezialangriffe Eures Tiers kritisch treffen."},
[210653] = {name = "[q2]Rune des Parierdolchs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Eure Handschuhe mit der Rune 'Parierdolch':\n\n\nGreift sofort mit Eurer Schildhandwaffe an und verursacht normalen Schildhandwaffenschaden. Erhöht Eure Parierchance 10 sec lang um 10%. Gewährt 3 Combopunkte.\n\n 'Parierdolch' nutzt die Vorteile aller Talente und Effekte, die durch 'Finsterer Stoß' ausgelöst werden oder 'Finsterer Stoß' modifizieren."},
[210654] = {name = "[q2]Zaubernotizen: Zeit zurückdrehen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Eure Handschuhe mit der Rune 'Zeit zurückdrehen':\n\n\nEuer aktuelles mit Eurem 'Zeitenleuchtfeuer' belegtes Ziel wird sofort um sämtlichen Schaden geheilt, den es in den letzten 5 Sek. erlitten hat. Wirkungslos bei Zielen, die vor 5 Sek. nicht mit 'Zeitenleuchtfeuer' belegt waren."},
[210655] = {name = "[q2]Zaubernotizen: ZÜDE RHENZUCKITER", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]Benutzen: Entschlüsselt die Zaubernotizen mit einem Verständnisamulett, um einen neuen Runenschnitzenzauber zu erlernen."},
