[210696] = {name = "[q2]Moderbann", additional_info = "Wird beim Aufheben gebunden\nWaffenhand Schwert\n18 - 34 Schaden Tempo 2.60\n(10.00 Schaden pro Sekunde)\nHaltbarkeit 60 / 60Klassen: Krieger\nBenötigt Stufe 14"},
[210708] = {name = "Elixier der verschmolzenen Reue", additional_info = "Benötigt Stufe 20\n[q2]Benutzen: Ermöglicht es dem Anwender, mit dem Leichnam eines Individuums zu sprechen, das in der Welt der Sterblichen noch unerledigte Angelegenheiten hat. Kann außerdem bei Verdauungsstörungen helfen. (3 Sek. Abklingzeit)"},
[210709] = {name = "[q2]Rezept: Elixier der verschmolzenen Reue", additional_info = "Benötigt Alchimie (90)\n[q2]Benutzen: Lehrt euch, wie man ein Elixier der verschmolzenen Reue herstellt.\nElixier der verschmolzenen Reue\nBenötigt Stufe 20\n[q2]Benutzen: Ermöglicht es dem Anwender, mit dem Leichnam eines Individuums zu sprechen, das in der Welt der Sterblichen noch unerledigte Angelegenheiten hat. Kann außerdem bei Verdauungsstörungen helfen. (3 Sek. Abklingzeit)\nBenötigt Würgetang (5), Verbleite Phiole , Grabmoos (5), Seelenstaub"},
[210712] = {name = "Elixier der Einsicht", additional_info = "Wird beim Aufheben gebunden\n[q2]Benutzen: Vernehmt eine Vision an Je'neus Freudenfeuer."},
[210713] = {name = "Gequälte Seele", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Benutzen: Reicht eine Opfergabe des Blutes dar, um diese gequälte Seele freizugeben."},
[210724] = {name = "Hirzeks Stab", additional_info = "Wird beim Aufheben gebunden"},
[210741] = {name = "[q3]Automatischer Meuteverprügler", additional_info = "Wird beim Aufheben gebunden\nZweihändig Streitkolben\n53 - 85 Schaden Tempo 2.00\n(34.50 Schaden pro Sekunde)\n+22 Stärke\n+8 Beweglichkeit\nHaltbarkeit 100 / 100Klassen: Paladin , Schamane , Druide\nBenötigt Stufe 40\n[q2]Anlegen: +69 Angriffskraft in Katzengestalt, Bärengestalt oder Terrorbärengestalt.\n[q2]Benutzen: Erhöht Euer Angriffstempo 30 sec lang um 50%. (3 Min Abklingzeit)\nGeplündert von: Meuteverprügler 9-60\nDropchance: 13.51%"},
[210746] = {name = "[q2]Rune des Erdschilds", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Prägt Eure Hosen mit der Rune 'Erdschild':\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30% Â and causing attacks to heal the shielded target for [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100]. Â This effect can only occur once every few seconds. Â 9 charges. Lasts 10 min. Â Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time."},
[210763] = {name = "Alteks Zweig", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[210765] = {name = "Kugel von Des", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[210771] = {name = "[q2]Abgefangene Vorräte: Kupferbarren", additional_info = "Wird beim Aufheben gebunden\nEinzigartig: [Waylaid Shipment] (12)\n[q2]Benutzen: Fügt 20 Kupferbarren hinzu, um die Lieferung zu vervollständigen."},
[210772] = {name = "[q2]Versorgungslieferung: Kupferbarren", additional_info = "Wird beim Aufheben gebunden\nEinzigartig: [Supply Shipment] (1)"},
[210773] = {name = "[q3]Mantel des Zweiten Krieges", additional_info = "Wird beim Anlegen gebunden\nSchulter Kette\n163 Rüstung\n+8 Ausdauer\nHaltbarkeit 70 / 70\nBenötigt Stufe 25\n[q2]Anlegen: Erhöht durch Heiligzauber und Heiligeffekte zugefügten Schaden um bis zu 11."},
[210779] = {name = "[q2]Pläne: Mantel des Zweiten Krieges", additional_info = "Wird beim Aufheben gebunden\nBenötigt Schmiedekunst (150)\n[q2]Benutzen: Lehrt Euch, wie man einen Mantel des Zweiten Krieges herstellt.\n[q3]Mantel des Zweiten Krieges\nWird beim Anlegen gebunden\nSchulter Kette\n163 Rüstung\n+8 Ausdauer\nHaltbarkeit 70 / 70\nBenötigt Stufe 25\n[q2]Anlegen: Erhöht durch Heiligzauber und Heiligeffekte zugefügten Schaden um bis zu 11.\nBenötigt Bronzebarren (20), Moosachat (2), Geringer Mondstein (2), Schillernde Perle (2), Silberbarren (4)"},
[210781] = {name = "[q3]Phönixbindungen", additional_info = "Wird beim Anlegen gebunden\nHandgelenke Stoff\n21 Rüstung\nHaltbarkeit 30 / 30\nBenötigt Stufe 25\n[q2]Anlegen: Erhöht durch Feuerzauber und Feuereffekte zugefügten Schaden um bis zu 13."},
[210794] = {name = "[q4]Veränderliche silberne Brustplatte", additional_info = "Wird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Brust Kette\n238 Rüstung\n+12 Stärke\n+5 Ausdauer\nHaltbarkeit 145 / 145\nBenötigt Stufe 25\nBenötigt Schmiedekunst (100)\n[q2]Anlegen: Dieser Gegenstand ist mit der rohen Macht der Leere erfüllt. Wenn der Träger angegriffen wird, hat dieser Gegenstand eine hohe Chance, einen schrecklichen Fluch zu wirken, durch den der Angreifer 15 Sek. lang zusätzlichen Schaden aus allen Quellen erleidet. (Procchance: 25%)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
[210795] = {name = "[q4]Extraplanare Spinnenseidenstiefel", additional_info = "Wird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Füße Stoff\n35 Rüstung\n+5 Ausdauer\n+5 Intelligenz\n+6 Willenskraft\nHaltbarkeit 50 / 50\nBenötigt Stufe 25\nBenötigt Schneiderei (100)\n[q2]Benutzen: Tretet zeitweise in eine andere Existenzebene ein, was sofort die Bedrohung reduziert und allen erlittenen und verursachten Schaden 6 sec lang um 30% verringert. (10 Min Abklingzeit)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 7.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
[210811] = {name = "[q2]Rune des urzeitlichen Zorns", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Prägt Eure Hosen mit der Rune 'Schamanistische Wut':\n\n\nReduces all damage you take by 20% and you regenerate mana equal to 5% of your maximum mana every second for 15 sec. Your party and raid members within 40 yards will also receive 20% of the mana you receive this way."},
[210817] = {name = "[q2]Rune des Überlebens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Überleben des Stärkeren':\n\n\nVerringert die Chance, dass Ihr einen kritischen Treffer durch Nahkampfangriffe erleidet, um 6% und verringert jeglichen erlittenen Schaden um 10%. Verringert den erlittenen Schaden zusätzlich um 10%, während Ihr in Bärengestalt oder Terrorbärengestalt seid."},
[210818] = {name = "[q2]Rune des einsamen Wolfs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Einsamer Wolf':\n\n\nIhr verursacht mit allen Angriffen 30% mehr Schaden, während Ihr kein Tier aktiviert habt."},
[210820] = {name = "[q2]Rune der Opferung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Eure Hosen mit der Rune 'Heilige Opferung':\n\n\n30% jeglichen von Gruppenmitgliedern im Umkreis von 30 Metern erlittenen Schadens werden 10 sec lang auf den Paladin umgelenkt. Schaden, der die Gesundheit des Paladins auf unter 20% senkt, bricht den Effekt ab und erhöht 10 sec lang den Schaden und die Heilung des Paladins um 10%. 'Heilige Opferung' kann unter dem Einfluss von 'Segen des Schutzes', 'Gottesschild' oder 'Göttlicher Schutz' nicht verwendet werden und verhindert, dass Ihr mit diesen Fähigkeiten anvisiert werden könnt, während 'Heilige Opferung' aktiv ist."},
[210822] = {name = "[q2]Harmonische Offenbarung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Glücksfall':\n\n\nEure Heilung mit 'Blitzheilung' verringert die Zauberzeit Eures nächsten Einsatzes von 'Geringe Heilung', 'Heilung', 'Große Heilung' oder 'Gebet der Heilung' 20 sec lang um 20%. Bis zu 3-mal stapelbar."},
[210823] = {name = "[q2]Rune der Beidhändigkeitsspezialisierung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Beidhändigkeitsspezialisierung':\n\n\nErhöht beim beidhändigen Führen Eure Chance, mit Zaubern und Nahkampfangriffen Treffer zu landen, um 10%. Außerdem trifft Eure Fähigkeit 'Sturmschlag' jetzt mit beiden Waffen, wenn Ihr beidhändig führt, und erhöht den verursachten Schaden Eurer Schildhandwaffe um 50%."},
[210824] = {name = "[q2]Rune des Pakts", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Hosen mit der Rune 'Dämonischer Pakt':\n\n\nDie kritischen Treffer Eures Begleiters belegen Eure Gruppenmitglieder 45 sec lang mit dem Effekt 'Dämonischer Pakt'. Der dämonische Pakt erhöht den Zauberschaden und die Heilung um 10% Eures Zauberschadens oder um ( 60 / 2), je nachdem, welcher Wert höher ist. Unterworfene Dämonen können diesen Effekt nicht auslösen."},
[210825] = {name = "[q2]Rune des Kriegshetzers", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Euer Brustteil mit der Rune 'Kriegstreiber':\n\n\nEure Fähigkeiten 'Sturmangriff', 'Abfangen' und 'Einschreiten' sind nun während des Kampfes und in jeder Haltung nutzbar und werden bei Aktivierung jegliche bewegungseinschränkenden Effekte entfernen."},
[210953] = {name = "Auge von Bhossca", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[210955] = {name = "Uniform eines scharlachroten Initianden", additional_info = "Wird beim Aufheben gebunden\nEinzigartig\n[q2]Benutzen: Verkleidet Euch als ein Mitglied des Scharlachroten Kreuzzugs. Verdächtiges Verhalten lässt die Verkleidung auffliegen."},
[210963] = {name = "Seherschlüssel", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke"},
[210966] = {name = "Blut der Legion", additional_info = "Questgegenstand\nEinzigartig (10)"},
[210967] = {name = "Vertrauliche Nachricht", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]<Zum Lesen rechtsklicken>"},
[210968] = {name = "Reliquiarschlüssel", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke"},
[210979] = {name = "[q2]Rune des Schattenschritts", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Euren Gürtel mit der Rune 'Schattenschritt':\n\n\nVersucht, in die Schatten zu tauchen, um hinter dem Gegner zu erscheinen. Erhöht 3 sec lang die Bewegungsgeschwindigkeit um 70%."},
[210980] = {name = "[q2]Rune der Metamorphose", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Handschuhe mit der Rune 'Metamorphose':\n\n\nVerwandelt Euch in einen Dämon. Eure Rüstung wird um 500% erhöht, die Chance, kritische Treffer zu erleiden, um 6% verringert. Eure Bedrohung wird um 50% erhöht und 'Aderlass' gewährt 100% mehr Mana. Einiger Eurer Fähigkeiten werden verändert und neue werden Euch gewährt:\n\n 'Sengender Schmerz': Wird zu einem Spontanzauber.\n\n 'Schattenblitz': Wird zu 'Schattenspalten', einem Nahkampfangriff, der bis zu 3 Gegner in der Nähe mit Schattenschaden trifft, aber eine Abklingzeit von 6 Sek. hat.\n\n 'Furcht': Wird durch 'Plagegeist' ersetzt.\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet.\n\n 'Dämonischer Ansturm'\n\n\nStürmt auf einen Gegner zu und betäubt ihn für 1 sec Kann nicht im Kampf verwendet werden.\n\n 'Dämonisches Heulen'\n\n\nZwingt alle Gegner in der Nähe 6 sec lang, ihre Angriffe auf Euch zu konzentrieren."},
[211205] = {name = "[q2]Rune des Löwenherzens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Löwenherz':\n\n\nDer Jäger beschwört das Herz eines Löwen, was alle Werte aller Verbündeten in der Nähe um 10% und alle Werte des Jägers um zusätzlich 10% erhöht."},
[211247] = {name = "[q2]Muster: Phönixbindungen", additional_info = "Wird beim Aufheben gebunden\nBenötigt Schneiderei (125)\n[q2]Benutzen: Lehrt Euch, wie man Phönixbindungen näht.\n[q3]Phönixbindungen\nWird beim Anlegen gebunden\nHandgelenke Stoff\n21 Rüstung\nHaltbarkeit 30 / 30\nBenötigt Stufe 25\n[q2]Anlegen: Erhöht durch Feuerzauber und Feuereffekte zugefügten Schaden um bis zu 13.\nBenötigt Wollstoffballen (6), Fläschchen Öl (2), Feiner Faden (2)"},
[211263] = {name = "[q4]Brustschutz des Richturteils", additional_info = "Wird beim Aufheben gebunden\nBrust Platte\n857 Rüstung\n+17 Stärke\n+25 Ausdauer\n+20 Intelligenz\n+10 Feuerwiderstand\n+10 Naturwiderstand\nHaltbarkeit 165 / 165Klassen: Paladin\nBenötigt Stufe 60\n[q2]Anlegen: Verteidigung +6.\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 14.\n[q2]Anlegen: Erhöht den Blockwert Eures Schilds um 32.\n\n[q]Bollwerk des Richturteils (0/8)\n[q0]Gürtel des Richturteils\nBindungen des Richturteils\nBrustschutz des Richturteils\nKrone des Richturteils\nStulpen des Richturteils\nBeinplatten des Richturteils\nSabatons des Richturteils\nSchiftung des Richturteils\n[q0](3) Set : Erhöht den Radius der Auren eines Paladins um 10.\n(5) Set : Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 47.\n(8) Set : Das Richturteil eines Paladins fügt dem Ziel 60 to 66 zusätzlichen Heiligschaden zu."},
