[211386] = {name = "[q2]Zaubernotizen: Arkane Woge", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Eure Hosen mit der Rune 'Arkane Woge':\n\n\nKanalisiert all Euer verbleibendes Mana in einer Woge aus Energie auf das Ziel. Verursacht [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 226 / 100] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 264 / 100] Arkanschaden, der abhängig von Eurem verbleibenden Mana um bis zu 300% erhöht ist. Anschließend wird Eure normale Manaregeneration aktiviert und ist 8 sec lang um 300% erhöht."},
[211387] = {name = "[q2]Rune des lockenden Lichts", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Eure Handschuhe mit der Rune 'Flamme des Glaubens':\n\n\nDas Ziel wird für alle Gruppen- und Schlachtzugsmitglieder in einem Radius von 40 Metern zu einer Flamme des Glaubens. Alle auf diese Mitglieder gewirkten Heilungen heilen auch die Flamme um 100% der gewirkten Heilung. Es kann immer nur ein Ziel zur gleichen Zeit eine Flamme des Glaubens sein. Hält 1 min lang an."},
[211390] = {name = "[q2]Rune des Reizens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Nur eine Fleischwunde':\n\n\nIhr erleidet 20% weniger körperlichen Schaden, während 'Klingentanz' aktiv ist. Außerdem ist die Chance, dass Ihr kritische Treffer durch Nahkampfangriffe erleidet, um 6% verringert, die Bedrohung durch all Eure Aktionen ist massiv erhöht und Eure Fähigkeit 'Finte' wird durch 'Reizen' ersetzt. 'Reizen' verspottet das Ziel, damit es Euch angreift.\n\n\nVerspottet das Ziel, damit es Euch angreift. Hat keinen Effekt, wenn Ihr von dem Ziel bereits angegriffen werdet."},
[211391] = {name = "[q2]Rune des heilenden Regens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Heilender Regen':\n\n\nWählt einen Bereich von 15 Metern um den anvisierten Spielercharakter aus und heilt alle Gruppenmitglieder des anvisierten Spielercharakters im Bereich pro Sekunde um [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] Gesundheit."},
[211392] = {name = "[q2]Rune der immerwährenden Gebrechen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Euren Hosen mit der Rune 'Immerwährende Gebrechen':\n\n\n'Blutsauger', 'Seelendieb', 'Schattenblitz', 'Schattenspalten', 'Sengender Schmerz', 'Einäschern' und 'Heimsuchung' setzen die Dauer Eurer 'Verderbnis' auf dem Ziel auf das Maximum zurück."},
