[211488] = {name = "[q2]Rune des Rächers", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Prägt Eure Hosen mit der Rune 'Schild des Rächers':\n\n\nSchleudert einen heiligen Schild auf den Gegner, der [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] bis [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] Heiligschaden verursacht, ihn benommen macht und dann auf weitere Gegner in der Nähe überspringt. Wirkt auf insgesamt 3 Ziele. Hält 10 sec lang an."},
[211490] = {name = "[q2]Prophezeiung der tausend Lichter", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Handschuhe mit der Rune 'Kreis der Heilung':\n\n\nHeilt alle Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 40 Metern um ihn herum um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] bis [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] Gesundheit.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
