[211498] = {name = "[q3]Nachtsäbler des Schildwachenrekruten", additional_info = "Wird beim Aufheben gebunden\nReittierBenötigt eine Allianz-Rasse\nBenötigt Stufe 25\n[q2]Benutzen: Beschwört einen Nachtsäbler des Schildwachenrekruten. Kann nur in Ashenvale verwendet werden. (3 Sek. Abklingzeit)"},
[211499] = {name = "[q3]Vorhutwolf des Rekruten", additional_info = "Wird beim Aufheben gebunden\nReittierBenötigt eine Horde-Rasse\nBenötigt Stufe 25\n[q2]Benutzen: Beschwört einen Vorhutwolf des Rekruten. Kann nur in Ashenvale verwendet werden. (3 Sek. Abklingzeit)"},
[211500] = {name = "[q3]Zähes Stirnband", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKopf Stoff\n50 Rüstung\nHaltbarkeit 50 / 50\nBenötigt Stufe 20\n[q2]Anlegen: Reduziert jeglichen erlittenen Schaden und die Chance, kritische Treffer zu erleiden in der Warsongschlucht um 5%."},
[211501] = {name = "[q4]Brustschutz der Macht", additional_info = "Wird beim Aufheben gebunden\nBrust Platte\n749 Rüstung\n+27 Stärke\n+18 Ausdauer\n+10 Feuerwiderstand\nHaltbarkeit 165 / 165Klassen: Krieger\nBenötigt Stufe 60\n[q2]Anlegen: Erhöht Eure Chance, einen kritischen Treffer zu erzielen, um 1%.\n[q2]Anlegen: Verbessert Eure Trefferchance um 1%.\n\n[q]Kampfplatte der Macht (0/8)\n[q0]Gürtel der Macht\nArmschienen der Macht\nBrustschutz der Macht\nStulpen der Macht\nHelm der Macht\nBeinplatten der Macht\nSchulterstücke der Macht\nSabatons der Macht\n[q0](3) Set : Erhöht den Blockwert Eures Schildes um 30.\n(5) Set : Gewährt Euch eine Chance von 20%, einen zusätzlichen Wutpunkt zu generieren, wenn Euch Nahkampfschaden zugefügt wird. (Procchance: 20%)\n(8) Set : Erhöht die von Euren Zaubern 'Rüstung zerreißen' verursachte Bedrohung um 15%."},
[211502] = {name = "[q4]Leerenberührte Lederstulpen", additional_info = "Wird beim Aufheben gebunden\nEinzigartig anlegbar: [Void-Touched] (1)Hände Leder\n70 Rüstung\n+5 Ausdauer\n+7 Intelligenz\n+6 Willenskraft\nHaltbarkeit 70 / 70\nBenötigt Stufe 25\nBenötigt Lederverarbeitung (100)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Verfallt in Wahnsinn und erhöht so 10 sec lang Euren Zauberschaden um 10% sowie Eure erzeugte Bedrohung. (10 Min Abklingzeit)"},
[211504] = {name = "[q3]Kettenpanzer des Twilight-Rächers", additional_info = "Wird beim Aufheben gebunden\nBrust Kette\n218 Rüstung\n+9 Stärke\n+6 Beweglichkeit\n+8 Ausdauer\nHaltbarkeit 120 / 120\nBenötigt Stufe 25\n[q2]Anlegen: Verteidigung +4.\n\n[q]Kettenrüstung des Blackfathom-Rächers (0/3)\n[q0]Stiefel des Twilight-Rächers\nKettenpanzer des Twilight-Rächers\nHelm des Twilight-Rächers\n[q0](2) Set : +12 Angriffskraft.\n(3) Set : Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
