[211507] = {name = "[q3]Gugel des Twilight-Elementaristen", additional_info = "Wird beim Aufheben gebunden\nKopf Leder\n84 Rüstung\n+9 Ausdauer\n+10 Intelligenz\nHaltbarkeit 60 / 60\nBenötigt Stufe 25\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 8.\n\n[q]Lederrüstung des Blackfathom-Elementaristen (0/3)\n[q0]Gugel des Twilight-Elementaristen\nFußpolster des Twilight-Elementaristen\nRobe des Twilight-Elementaristen\n[q0](2) Set : Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 12.\n(3) Set : Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
