[211510] = {name = "[q3]Gugel des Twilight-Schlächters", additional_info = "Wird beim Aufheben gebunden\nKopf Leder\n84 Rüstung\n+10 Beweglichkeit\n+9 Ausdauer\nHaltbarkeit 60 / 60\nBenötigt Stufe 25\n[q2]Anlegen: +14 Angriffskraft.\n\n[q]Lederrüstung des Blackfathom-Schlächters (0/3)\n[q0]Gugel des Twilight-Schlächters\nFußpolster des Twilight-Schlächters\nTunika des Twilight-Schlächters\n[q0](2) Set : +12 Angriffskraft.\n(3) Set : Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
