[211512] = {name = "[q0]Tunika des Twilight-Schlächters", additional_info = "Wird beim Aufheben gebunden\nBrust Leder\n103 Rüstung\n+13 Beweglichkeit\n+9 Ausdauer\nHaltbarkeit 100 / 100\nBenötigt Stufe 25\n\n[q]Lederrüstung des Blackfathom-Schlächters (0/3)\n[q0]Gugel des Twilight-Schlächters\nFußpolster des Twilight-Schlächters\nTunika des Twilight-Schlächters\n[q0](2) Set : +12 Angriffskraft.\n(3) Set : Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%."},
[211514] = {name = "[q2]Zaubernotizen: Massenregeneration", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Euren Hosen mit der Rune 'Massenregeneration':\n\n\nHeilt alle verbündeten Gruppenmitglieder des anvisierten Spielercharakters innerhalb von 30 Metern um den anvisierten Spielercharakter im Verlauf von 3 sec um [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] Gesundheit und belegt jedes Ziel für 15 Sek. mit 'Zeitenleuchtfeuer'.\n\n Zeitenleuchtfeuer\n\nErfasst die raumzeitliche Position des Subjekts. 80% sämtlichen Arkanschadens, den der Zaubernde verursacht hat, werden für alle aktuellen Ziele von 'Zeitenleuchtfeuer' des Zaubernden in chronomantische Heilung umgewandelt. Diese Heilung ist für den Zaubernden selbst um 50% verringert und wird zudem um 80% verringert, wenn durch arkane Zauber, die mehrere Ziele gleichzeitig treffen, Schaden verursacht wird."},
[211528] = {name = "Dunkle Einsicht", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Benutzen: Meditiert über ein gewisses abgelegenes Grab im Dämmerwald, um eine Prophezeiung zu erhalten."},
[211530] = {name = "[q2]Prophezeiung der ergriffenen Stadt", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Hosen mit der Rune 'Machtwort: Barriere':\n\n\nBeschwört eine heilige Barriere, die alle Gruppenmitglieder am Zielort 10 sec lang beschützt. Die Barriere verringert sämtlichen erlittenen Schaden um 25% und verhindert, dass erlittener Schaden das Zaubern verzögert.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[211531] = {name = "[q2]Prophezeiung der sieben Besucher", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euer Brustteil oder Eure Robe mit der Rune 'Kraftvolle Seele':\n\n\n'Geringe Heilung', 'Heilung', 'Große Heilung' und 'Blitzheilung' verringern die verbleibende Dauer von 'Geschwächte Seele' auf den geheilten Zielen um 4 Sek. Zusätzlich erhalten Ziele Eures Zaubers 'Machtwort: Schild' 'Wut', wenn sie trotz absorbierten Schadens Schaden erleiden, und 'Zorn der Gerechtigkeit' wird durch von 'Machtwort: Schild' absorbiertem Schaden ausgelöst, als wäre es eine Heilung.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[211534] = {name = "Ursprüngliche Eingebung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Benutzen: Meditiert über einen Traumfänger der Distelfelle hoch in den Bäumen, um eine Prophezeiung zu erhalten."},
[211691] = {name = "[q2]Zaubernotizen: Arkanschlag", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Prägt Eure Handschuhe mit der Rune 'Arkanschlag':\n\n\nÜberzieht das Ziel mit Energie und verursacht [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] bis [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] Arkanschaden. Mit jedem Wirken von 'Arkanschlag' werden der verursachte Schaden und die hervorgerufene Heilung aller anderen Arkanzauber um 15% und die Manakosten von 'Arkanschlag' um 175% erhöht. Dieser Effekt ist bis zu 4-mal stapelbar und hält 6 sec lang an oder bis ein anderer Arkanschadens- oder -heilzauber gewirkt wird."},
