[212549] = {name = "[q2]Rune des Fallenstellers", additional_info = "Wird beim Aufheben gebunden\nKlassen: Jäger\n[q2]Prägt Eure Stiefel mit der Rune 'Fallenschleuder':\n\n\nEure Fallen können jetzt an jedem Ort innerhalb von 35 Metern ausgelegt werden, auch wenn Ihr in einen Kampf verwickelt seid. Außerdem haben Eure feuer- und frostbasierten Fallen jetzt getrennte gemeinsame Abklingzeiten."},
