[213102] = {name = "[q2]Rune der Tücke", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Prägt Eure Stiefel mit der Rune 'Tanz des Tückischen':\n\n\nIhr und Euer Dämon erhaltet jedes Mal, wenn Ihr einem Gegner einen kritischen Treffer zufügt, eine Ausweichchance entsprechend Eurer kritischen Zaubertrefferchance. Ihr beide gewinnt außerdem 2% Eures maximalen Manas zurück."},
[213105] = {name = "[q3]Schawarmageddon", additional_info = "Wird beim Aufheben gebunden\nEinhändig Streitkolben\n50 - 93 Schaden Tempo 2.60\n(27.50 Schaden pro Sekunde)\nHaltbarkeit 90 / 90Klassen: Krieger\nBenötigt Stufe 40\n[q2]Benutzen: Erhöht das Angriffstempo um 4% und verleiht allen Nahkampfangriffen eine Chance, zusätzlich 7 Feuerschaden zu verursachen. (2 Min Abklingzeit)"},
[213110] = {name = "[q2]Rune des Kommandanten", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Prägt Eure Stiefel mit der Rune 'Anspornender Schrei':\n\n\nStoßt einen anspornenden Schrei aus, der die maximale Gesundheit aller Gruppen- und Schlachtzugsmitglieder innerhalb von 40 Metern 10 sec lang um 15% erhöht."},
[213121] = {name = "[q2]Konservierter Tannenzweig", additional_info = "Benötigt Stufe 25\n[q2]Benutzen: Verwandelt Euer Reittier in eine etwas festlichere Gestalt. (1 Min Abklingzeit)"},
[213122] = {name = "[q2]Rune des zuverlässigen Schusses", additional_info = "Wird beim Aufheben gebunden\nKlassen: Jäger\n[q2]Prägt Euren Gürtel mit der Rune 'Zuverlässiger Schuss':\n\n\nEin zuverlässiger Schuss, der 60% Schaden mit Distanzwaffen verursacht.\nGeplündert von: Nadelzahn\nDropchance: 67.91%"},
[213124] = {name = "[q2]Rune des Nahkampfs", additional_info = "Wird beim Aufheben gebunden\nKlassen: Jäger\n[q2]Prägt Euren Gürtel mit der Rune 'Nahkampfspezialist':\n\n\n'Raptorstoß' ist ein Spontanzauber und seine Abklingzeit ist auf 3 Sek. verringert. Die Abklingzeit von 'Mungobiss' wird entfernt und bei 'Raptorstoß' besteht bei jedem Angriff eine Chance von 30%, keine Abklingzeit auszulösen."},
[213125] = {name = "[q2]Rune der Kräftigung", additional_info = "Wird beim Aufheben gebunden\nKlassen: Jäger\n[q2]Prägt Eure Stiefel mit der Rune 'Kräftigung':\n\n\nErzielt Euer Tier mit einer Spezialfähigkeit einen kritischen Treffer, werden sofort 5% Eures maximalen Manas wiederhergestellt."},
[213126] = {name = "[q2]Rune des Streiters", additional_info = "Wird beim Aufheben gebunden\nKlassen: Jäger\n[q2]Prägt Eure Stiefel mit der Rune 'Beidhändigkeitsspezialisierung':\n\n\nIncreases the damage done by your offhand weapon by 50% and causes your Raptor Strike to strike with both weapons when you are dual-wielding.\nGeplündert von: Guerilla der Bloodscalp\nDropchance: 81.07%"},
[213127] = {name = "[q2]Zaubernotizen: BLAUBERZORFSTITZ", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Benutzen: Entschlüsselt die Zaubernotizen mit einem Verständnisamulett, um einen neuen Runenschnitzenzauber zu erlernen.\nGeplündert von: Mystiker der Skullsplitter\nDropchance: 0.12%"},
[213142] = {name = "[q2]Prophezeiung der gefangenen Bösartigkeit", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Stiefel mit der Rune 'Dispersion':\n\n\nLöst Euch zu reiner Schattenenergie auf und verringert jeglichen erlittenen Schaden um 90%. Ihr könnt weder angreifen noch Zauber wirken, regeneriert jedoch 6 sec lang alle 1 Sek. 6% Mana. 'Dispersion' kann gewirkt werden, während Betäubungs-, Furcht- oder Stilleeffekte auf Euch wirken. Bei Anwendung werden alle wirkenden Verlangsamungs- und bewegungseinschränkenden Effekte entfernt und Ihr werdet für die Dauer des Effektes von 'Dispersion' gegen sie immun.\n[q2]Benutzen: Konzentriert Euch auf die Prophezeiung, um einen neuen Zauber zu lernen. Erfordert einen durch Meditation über zwei spirituelle Geheimnisse Azeroths konzentrierten Geist."},
[213144] = {name = "[q2]Leuchtende Offenbarung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Eure Stiefel mit der Rune 'Geist des Erlösers':\n\n\nAktivieren, um 10 sec lang zum Geist der Erlösung zu werden. In dieser Gestalt könnt Ihr alle Heilzauber kostenlos wirken, Ihr könnt Euch aber nicht bewegen, nicht angreifen, nicht angegriffen werden oder von Zaubern oder Effekten als Ziel ausgewählt werden. Erfordert das Talent 'Geist der Erlösung', um aktiviert zu werden, und wenn Ihr sterbt, nehmt Ihr die Gestalt 'Geist der Erlösung' nicht mehr an."},
[213165] = {name = "Basilisken: Muss man Angst vor der Versteinerung haben?", additional_info = "Wird beim Aufheben gebunden\nEinzigartig"},
[213168] = {name = "[q2]Kupferblutmünze", additional_info = "Wird beim Aufheben gebunden\n[q2]Benutzen: Transmutiert 100 Kupferblutmünzen in 1 Silberblutmünze."},
