[213278] = {name = "[q3]Handschützer des Pömpfmeisters", additional_info = "Wird beim Aufheben gebunden\nHände Leder\n84 Rüstung\n+10 Beweglichkeit\n+11 Ausdauer\nHaltbarkeit 35 / 35\nBenötigt Stufe 40\n[q2]Anlegen: Faustwaffen um 3 erhöht.\n[q2]Anlegen: Streitkolben +3.\nGeplündert von: Meuteverprügler 9-60\nDropchance: 16.76%"},
[213279] = {name = "[q3]Reflektierende Schädelkappe", additional_info = "Wird beim Aufheben gebunden\nKopf Kette\n222 Rüstung\n+11 Ausdauer\n+13 Intelligenz\n+8 Willenskraft\nHaltbarkeit 70 / 70\nBenötigt Stufe 40\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 13.\nGeplündert von: Elektrokutor 6000\nDropchance: 5.77%"},
