[213513] = {name = "[q2]Buchband der Erlösung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Buchband\nKlassen: Paladin\nBenötigt Stufe 18\n[q2]Prägt Eure Stiefel mit der Rune 'Geheiligter Schild':\n\n\nJedes Mal, wenn das Ziel Schaden erleidet, wird es von einem geheiligten Schild umhüllt, der [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] Schaden absorbiert und die Chance des Paladins, mit 'Lichtblitz' einen kritischen Treffer zu erzielen, bis zu 6 sec lang um 50% erhöht. Zusätzlich heilen Eure Einsätze von 'Lichtblitz' Ziele mit 'Geheiligter Schild' im Verlauf von 12 sec um weitere 100% Gesundheit. Dieser Effekt kann nur einmal alle 6 Sek. auftreten. Hält 30 sec lang an. Es kann immer nur jeweils ein Ziel mit diesem Zauber belegt sein."},
