[213594] = {name = "[q2]Götze der Zwischenrufe", additional_info = "Wird beim Aufheben gebunden\nEinzigartigRelikt Götze\nKlassen: Druide\nBenötigt Stufe 28\n[q2]Prägt Euren Gürtel mit der Rune 'Berserker':\n\n\nWenn aktiviert, lässt diese Fähigkeit 'Zerfleischen (Bär)' und 'Aufschlitzen' bis zu 3 Ziele treffen und 'Zerfleischen (Bär)' unterliegt keiner Abklingzeit. In Katzengestalt werden die Energiekosten aller Eurer Fähigkeiten um 50% verringert. Hält 15 sec lang an. Erfordert Katzengestalt, Bärengestalt oder Terrorbärengestalt.\n\n Entfernt sofort Furchteffekte und macht Euch während seiner Dauer gegen sie immun.\nGeplündert von: Zai'enki\nDropchance: 88.19%"},
[213599] = {name = "[q2]Beunruhigende Vision", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Prägt Euren Gürtel mit der Rune 'Erneuerte Hoffnung':\n\n\nDie Chance auf kritische Effekte Eurer Einsätze von 'Blitzheilung', 'Geringe Heilung', 'Heilung', 'Große Heilung' und 'Sühne' ist um 10% erhöht, wenn Ihr sie auf Ziele wirkt, die mit 'Geschwächte Seele' belegt sind.\n[q2]Benutzen: Konzentriert Euch auf die Vision, um einen neuen Zauber zu lernen. Erfordert einen Blick auf verderbtes Wissen."},
