[215111] = {name = "[q4]Gneuro-verkettetes Arkanfaden-Monokel", additional_info = "Wird beim Aufheben gebunden\nKopf Stoff\n58 Rüstung\n+10 Ausdauer\n+11 Intelligenz\nHaltbarkeit 60 / 60\nBenötigt Stufe 40\nBenötigt Schneiderei (225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 22.\n[q2]Anlegen: Stellt alle 5 Sek. 4 Punkt(e) Mana wieder her.\n[q2]Benutzen: Ihr macht Euch die latente Arkanenergie in der Umgebungsluft zunutze und erhaltet 'Aufgeladene Inspiration', was 12 sec lang die Manakosten aller Zauber um 50% verringert und ihren verursachten Schaden und die durch sie hervorgerufene Heilung um bis zu 50 erhöht. (10 Min Abklingzeit)"},
[215114] = {name = "[q4]Leuchtende hyperleitende Schuppenkappe", additional_info = "Wird beim Aufheben gebunden\nKopf Kette\n242 Rüstung\n+14 Ausdauer\n+15 Intelligenz\nHaltbarkeit 85 / 85\nBenötigt Stufe 40\nBenötigt Lederverarbeitung (225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 21.\n[q2]Benutzen: Belegt Euch mit 'Hyperleitender Schock', was Euch sofort 312 to 688 Schaden zufügt, aber auch Euer Zauberwirken 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)"},
[215115] = {name = "[q4]Hyperleitendes Goldnetz", additional_info = "Wird beim Aufheben gebunden\nTaille Stoff\n40 Rüstung\n+9 Ausdauer\nHaltbarkeit 35 / 35\nBenötigt Stufe 40\nBenötigt Ingenieurskunst (225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Ihr zieht eine hyperleitende Münze aus Eurem Gürtel und werft sie hoch. Kopf: Erhöht Eure kritische Trefferchance mit allen Zaubern und Angriffen 30 sec lang um 3%. Zahl: Erhöht Eure Bewegungsgeschwindigkeit 30 sec lang um 10%. (15 Min Abklingzeit)"},
[215127] = {name = "[q2]Hoch wirksame Strahlungsbombe", additional_info = "Benötigt Stufe 35\nBenötigt Ingenieurskunst (200)\n[q2]Benutzen: Verursacht im Explosionsradius 150 to 250 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 25 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen until cancelled lang um 25%. (1 Min Abklingzeit)"},
[215129] = {name = "[q4]Formel: Waffe - Zerlegen", additional_info = "Wird beim Aufheben gebunden\nBenötigt Verzauberkunst (225)\n[q2]Benutzen: Eine Waffe dauerhaft verzaubern, sodass alle Zauber und Angriffe mechanischen Kreaturen manchmal 60 to 90 zusätzlichen Schaden mit Zaubern zufügen."},
[215138] = {name = "[q4]Formel: Brust - Vergelter", additional_info = "Wird beim Aufheben gebunden\nBenötigt Verzauberkunst (225)\n[q2]Benutzen: Lehrt Euch, wie man eine Brustrüstung dauerhaft so verzaubert, dass sie bei eingehenden Nahkampfangriffen 9 Schaden auf den Angreifer zurückwirft."},
[215141] = {name = "[q2]Verzaubertes Siegel: Innovation", additional_info = "Wird beim Aufheben gebunden\nBenötigt Verzauberkunst (225)\n[q2]Benutzen: Lehrt Euch, wie man ein Siegel der Innovation beschwört.\n[q2]Verzaubertes Siegel: Innovation\nWird beim Aufheben gebunden\nEinzigartig (5)\nBenötigt Stufe 40\nBenötigt Verzauberkunst (225)\n[q2]Benutzen: Erhaltet ein verzaubertes Siegel der Innovation, das Euch ermächtigt, wodurch 30 min lang der verursachte Schaden und die hervorgerufene Heilung Eurer Zauber um bis zu 20 und Eure Angriffskraft um 20 erhöht wird. Dieser Effekt kann nur außerhalb des Kampfes angewandt werden. (30 Min Abklingzeit)\nBenötigt Visionenstaub (5)"},
[215149] = {name = "[q4]Muster: Gneuro-verkettetes Arkanfaden-Monokel", additional_info = "Wird beim Aufheben gebunden\nBenötigt Schneiderei (225)\n[q2]Benutzen: Lehrt Euch, wie man ein Gneuro-verkettetes Arkanfaden-Monokel herstellt.\n[q4]Gneuro-verkettetes Arkanfaden-Monokel\nWird beim Aufheben gebunden\nKopf Stoff\n58 Rüstung\n+10 Ausdauer\n+11 Intelligenz\nHaltbarkeit 60 / 60\nBenötigt Stufe 40\nBenötigt Schneiderei (225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 22.\n[q2]Anlegen: Stellt alle 5 Sek. 4 Punkt(e) Mana wieder her.\n[q2]Benutzen: Ihr macht Euch die latente Arkanenergie in der Umgebungsluft zunutze und erhaltet 'Aufgeladene Inspiration', was 12 sec lang die Manakosten aller Zauber um 50% verringert und ihren verursachten Schaden und die durch sie hervorgerufene Heilung um bis zu 50 erhöht. (10 Min Abklingzeit)\nBenötigt Hyperleitender Arkanfaden (5), Schwach leuchtendes Leder , Isolierendes Gniodin , Visionenstaub (10), Magiestoffballen (10)"},
[215152] = {name = "[q4]Muster: Leuchtende Gneuro-verkettete Gugel", additional_info = "Wird beim Aufheben gebunden\nBenötigt Lederverarbeitung (225)\n[q2]Benutzen: Lehrt Euch, wie man eine leuchtende Gneuro-verkettete Gugel herstellt.\n[q4]Leuchtende Gneuro-verkettete Gugel\nWird beim Aufheben gebunden\nKopf Leder\n118 Rüstung\n+14 Beweglichkeit\n+14 Ausdauer\nHaltbarkeit 70 / 70\nBenötigt Stufe 40\nBenötigt Lederverarbeitung (225)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: +3 Waffenschaden.\n[q2]Benutzen: Belegt Euch mit 'Gneurologischer Schock', was Euch sofort 343 to 757 Schaden zufügt, aber auch Eure Nahkampf- und Distanzangriffe 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)\nBenötigt Hyperleitender Arkanfaden , Geschmeidiger dicker Balg (5), Seidenfaden (2), Schwach leuchtendes Leder (5)"},
[215153] = {name = "[q4]Bauplan: Wirbelnder Echtsilberzahnradschild", additional_info = "Wird beim Aufheben gebunden\nBenötigt Ingenieurskunst (225)\n[q2]Benutzen: Lehrt Euch, wie man einen wirbelnden Echtsilberzahnradschild herstellt.\n[q4]Wirbelnder Echtsilberzahnradschild\nWird beim Aufheben gebunden\nSchildhand Schild\n1760 Rüstung\n29 Blocken\n+9 Stärke\n+10 Ausdauer\nHaltbarkeit 120 / 120\nBenötigt Stufe 40\nBenötigt Ingenieurskunst (225)\n[q2]Anlegen: Erhöht Eure Chance, Angriffe mit einem Schild zu blocken, um 1%.\n[q2]Anlegen: Bei erfolgreichem Blocken fügen die wirbelnden rasiermesserscharfen Zahnräder dieses Schilds dem Angreifer 5 to 10 körperlichen Schaden und dem Träger 2 to 10 körperlichen Schaden zu.\nBenötigt Echtsilberplatten mit geringer Grundstrahlung (3), Polierte Echtsilberzahnräder (5), Schwach leuchtendes Leder (2), Mithrilgehäuse (2), Gyrochronatom (2), Mithrilbarren (15)"},
[215155] = {name = "[q4]Pläne: Gehärteter Interferenzen-negierender Helm", additional_info = "Wird beim Aufheben gebunden\nBenötigt Schmiedekunst (225)\n[q2]Benutzen: Lehrt Euch, wie man einen gehärteten Interferenzen-negierenden Helm herstellt.\n[q4]Gehärteter Interferenzen-negierender Helm\nWird beim Aufheben gebunden\nKopf Platte\n426 Rüstung\n+20 Stärke\n+14 Ausdauer\nHaltbarkeit 100 / 100\nBenötigt Stufe 40\nBenötigt Schmiedekunst (225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Gewährt höchste Konzentration, die 10 sec lang die Bewegungsgeschwindigkeit um 20% verringert, aber währenddessen Euren Zauberwiderstand gegen alle Magiearten um 50 sowie das Angriffstempo im Nahkampf um 20% erhöht. (10 Min Abklingzeit)\nBenötigt Mithrilbarren (25), Echtsilberplatten mit geringer Grundstrahlung (4), Hyperleitender Arkanfaden , Schwach leuchtendes Leder (2)"},
[215156] = {name = "[q4]Bauplan: Hyperleitendes Goldnetz", additional_info = "Wird beim Aufheben gebunden\nBenötigt Ingenieurskunst (225)\n[q2]Benutzen: Lehrt Euch, wie man ein hyperleitendes Goldnetz herstellt.\n[q4]Hyperleitendes Goldnetz\nWird beim Aufheben gebunden\nTaille Stoff\n40 Rüstung\n+9 Ausdauer\nHaltbarkeit 35 / 35\nBenötigt Stufe 40\nBenötigt Ingenieurskunst (225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Ihr zieht eine hyperleitende Münze aus Eurem Gürtel und werft sie hoch. Kopf: Erhöht Eure kritische Trefferchance mit allen Zaubern und Angriffen 30 sec lang um 3%. Zahl: Erhöht Eure Bewegungsgeschwindigkeit 30 sec lang um 10%. (15 Min Abklingzeit)\nBenötigt Polierte Echtsilberzahnräder (3), Hyperleitender Arkanfaden (3), Schwach leuchtendes Leder , Goldbarren (10)"},
[215161] = {name = "[q4]Gehärteter Interferenzen-negierender Helm", additional_info = "Wird beim Aufheben gebunden\nKopf Platte\n426 Rüstung\n+20 Stärke\n+14 Ausdauer\nHaltbarkeit 100 / 100\nBenötigt Stufe 40\nBenötigt Schmiedekunst (225)\n[q2]Anlegen: Erhöht Eure kritische Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Benutzen: Gewährt höchste Konzentration, die 10 sec lang die Bewegungsgeschwindigkeit um 20% verringert, aber währenddessen Euren Zauberwiderstand gegen alle Magiearten um 50 sowie das Angriffstempo im Nahkampf um 20% erhöht. (10 Min Abklingzeit)"},
[215162] = {name = "Leicht bestrahlter Verjüngungstrank", additional_info = "Wird beim Aufheben gebunden\nBenötigt Stufe 35\nBenötigt Alchimie (225)\n[q2]Benutzen: Stellt 262 to 438 Mana und 340 to 460 Gesundheit wieder her. Erhöht zudem 20 sec lang die Angriffskraft um 40 und den durch alle Zauber verursachten Schaden um 35. (2 Min Abklingzeit)"},
[215163] = {name = "[q4]Rezept: Leicht bestrahlter Verjüngungstrank", additional_info = "Wird beim Aufheben gebunden\nBenötigt Alchimie (225)\n[q2]Benutzen: Lehrt Euch, wie man einen leicht bestrahlten Verjüngungstrank aufbrüht.\nLeicht bestrahlter Verjüngungstrank\nWird beim Aufheben gebunden\nBenötigt Stufe 35\nBenötigt Alchimie (225)\n[q2]Benutzen: Stellt 262 to 438 Mana und 340 to 460 Gesundheit wieder her. Erhöht zudem 20 sec lang die Angriffskraft um 40 und den durch alle Zauber verursachten Schaden um 35. (2 Min Abklingzeit)\nBenötigt Kiste mit besudelter Gniodin-Lösung , Schwacher Verjüngungstrank , Ablagerung von Gnomeregan (3), Kristallphiole (5)"},
[215166] = {name = "[q4]Leuchtende Gneuro-verkettete Gugel", additional_info = "Wird beim Aufheben gebunden\nKopf Leder\n118 Rüstung\n+14 Beweglichkeit\n+14 Ausdauer\nHaltbarkeit 70 / 70\nBenötigt Stufe 40\nBenötigt Lederverarbeitung (225)\n[q2]Anlegen: Erhöht Eure Trefferchance mit allen Angriffen und Zaubern um 1%.\n[q2]Anlegen: +3 Waffenschaden.\n[q2]Benutzen: Belegt Euch mit 'Gneurologischer Schock', was Euch sofort 343 to 757 Schaden zufügt, aber auch Eure Nahkampf- und Distanzangriffe 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)"},
