[215168] = {name = "[q2]EZ-Thro-Strahlungsbombe", additional_info = "Benötigt Stufe 40\n[q2]Benutzen: Verursacht im Explosionsradius 112 to 188 Feuerschaden und zusätzlich 10 Sek. lang alle 2 Sek. 10 Naturschaden. Verringert außerdem die Bewegungsgeschwindigkeit von betroffenen Zielen 10 sec lang um 25%. (1 Min Abklingzeit)"},
