[215422] = {name = "[q4]Muster: Leuchtende hyperleitende Schuppenkappe", additional_info = "Wird beim Aufheben gebunden\nBenötigt Lederverarbeitung (225)\n[q2]Benutzen: Lehrt Euch, wie man eine leuchtende hyperleitende Schuppenkappe herstellt.\n[q4]Leuchtende hyperleitende Schuppenkappe\nWird beim Aufheben gebunden\nKopf Kette\n242 Rüstung\n+14 Ausdauer\n+15 Intelligenz\nHaltbarkeit 85 / 85\nBenötigt Stufe 40\nBenötigt Lederverarbeitung (225)\n[q2]Anlegen: Erhöht durch Zauber und magische Effekte zugefügten Schaden und Heilung um bis zu 21.\n[q2]Benutzen: Belegt Euch mit 'Hyperleitender Schock', was Euch sofort 312 to 688 Schaden zufügt, aber auch Euer Zauberwirken 10 sec lang um 20% beschleunigt. (10 Min Abklingzeit)\nBenötigt Echtsilberplatten mit geringer Grundstrahlung , Dicke Murlocschuppe (10), Schwach leuchtendes Leder (5), Isolierendes Gniodin"},
