[216738] = {name = "[q2]Handbuch des Umleitens", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schurke\n[q2]Entfernt all Eure bestehenden Combopunkte von Eurem Ziel und speichert sie bis zu 15 sec lang. Diese gespeicherten Combopunkte werden auf das nächste gegnerische Nichtspieler-Ziel übertragen, das Ihr mit einer Nahkampf- oder Distanzfähigkeit trefft."},
[216740] = {name = "[q2]Foliant der erweiterten Intelligenz", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Magier\n[q2]Senkt die Manakosten von 'Arkane Intelligenz' um 50% und verlängert dessen Dauer um 50%."},
[216744] = {name = "[q2]Schriftrolle der erhöhten Seelenstärke", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Senkt die Manakosten von 'Machtwort: Seelenstärke' um 50% und verlängert dessen Dauer um 50%."},
[216745] = {name = "[q2]Schriftrolle des Schattengeistes", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Priester\n[q2]Erschafft einen schattenhaften Geist, der das Ziel angreift. Der Zaubernde erhält bei einem Angriff des Schattengeists 5% Mana. Hält 15 sec lang an."},
[216746] = {name = "[q2]Handbuch des Befehlsrufs", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Krieger\n[q2]Der Krieger schreit, wodurch sich die Ausdauer aller Gruppenmitglieder innerhalb von 30 Metern um 2 erhöht. Hält 2 min lang an."},
[216747] = {name = "[q2]Zauberfoliant der Seelenernte", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Immer wenn 'Seelendieb' Schaden verursacht, habt Ihr eine Chance, einen zusätzlichen Seelensplitter zu erhalten. Diese Chance steigt jedes Mal, wenn Ihr keinen Seelensplitter erhaltet."},
[216748] = {name = "[q2]Zauberfoliant des Portals der Beschwörung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Hexenmeister\n[q2]Beginnt ein Ritual, das ein Beschwörungsportal erstellt, welches von zwei Gruppen- oder Schlachtzugsmitgliedern benutzt werden kann, um ein ausgewähltes Gruppen- oder Schlachtzugsmitglied zu beschwören. Um das Ritual zu vervollständigen, werden der Zaubernde und zwei zusätzliche Gruppen- oder Schlachtzugsmitglieder benötigt. Um teilzunehmen, müssen sich alle Spielercharaktere außerhalb eines Kampfes befinden, auf das Portal rechtsklicken und dürfen sich nicht bewegen, bis das Ritual abgeschlossen ist."},
[216764] = {name = "[q2]Handzettel der tiefen Wildnis", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Senkt die Manakosten von 'Mal der Wildnis' um 50% und verlängert dessen Dauer um 50%."},
[216767] = {name = "[q2]Handzettel der Wiederbelebung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Bringt einen toten Spielercharakter mit 15% Gesundheit und Mana wieder ins Leben zurück. Kann nicht im Kampf verwendet werden."},
[216768] = {name = "[q2]Bekenntnis der verbesserten Segen", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Paladin\n[q2]Erhöht die Dauer Eurer Zauber 'Segen der Macht', 'Segen der Weisheit', 'Segen der Rettung', 'Segen des Refugiums', 'Segen des Lichts' und 'Segen der Könige' um 100% und verringert ihre Manakosten um 50%."},
[216769] = {name = "[q2]Offenbarung der totemischen Projektion", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Schamane\n[q2]Bewegt Eure aktiven Totems an die angegebene Position."},
[216770] = {name = "[q2]Abhandlung zum Aspekt der Viper", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Jäger\n[q2]Der Jäger nimmt die Aspekte einer Viper an. Jeder Eurer automatischen Distanz- und Nahkampfangriffe regeneriert Mana, der gesamte verursachte Schaden wird jedoch um 10% verringert. Zusätzlich erhaltet Ihr alle 3 Sek. 10% Eures maximalen Manas. Das gewonnene Mana basiert auf dem Tempo Eurer Waffe. Es kann immer nur jeweils ein Aspekt aktiv sein."},
[216771] = {name = "[q2]Handzettel der verbesserten Wiederherstellung", additional_info = "Wird beim Aufheben gebunden\nEinzigartigKlassen: Druide\n[q2]Eure Zauber 'Verjüngung' und 'Nachwachsen' können auf Zielen aktiv sein, die von 'Verjüngung' oder 'Nachwachsen' eines anderen Druiden betroffen sind."},
[216879] = {name = "Mysteriöse Trollschriftrolle", additional_info = "EinzigartigKlassen: Magier\n[q2]Benutzen: Entziffert die Schriftrolle mit einem Verständnisamulett. Wer weiß, welche Magie sie enthält."},
